INSERT INTO `campaigns` (`id`, `title`, `description`, `status`, `created_at`, `updated_at`, `published_at`, `image`, `auth`, `link`, `meta_title`, `meta_description`) VALUES
(15, 'Be The Change: Uplifting Singbandi Village in Nepal', 'In March 2018, a small team of Be The Change ambassadors travelled with Linda Cruse to the \'forgotten village\' of Singbandi in Nepal. Their aim to provide a business hand-up to the community - in just four days, amazing things happened. In this blog, one of BTCs younger ambassadors - Oscar Hammond - eloquently sums up his Be The Change experience.', 'Active', '2018-05-21 19:22:42', '2018-05-21 19:22:42', '2018-03-28 07:00:00', 'R4G-1526905362.jpg', NULL, 'http://hammondthinking.com/?p=57738', NULL, NULL),
(14, 'Linda Cruse: Adventures in the Himalayas', 'During one of her first humanitarian assignments, Linda Cruse took medical students to the High Himalayas where they ran a health-care programme which would save lives.', 'Active', '2018-05-21 19:20:34', '2018-05-21 19:20:34', '2018-04-14 07:00:00', 'R4G-1526905234.jpg', NULL, 'https://mailchi.mp/7e2d65579bd5/adventures-in-the-himalayas', NULL, NULL),
(13, 'Linda Cruse: Unsung Heroes', 'In 2010, Linda was invited by Sir Richard Branson to lead on projects involving the Berber community in Morocco, one of which would change the destiny of a local unsung hero, Hameed.', 'Active', '2018-05-21 19:17:58', '2018-05-21 19:17:58', '2018-05-12 07:00:00', 'R4G-1526905078.jpg', NULL, 'https://mailchi.mp/fc2b9076c921/linda-cruse-unsung-heroes', NULL, NULL),
(16, 'Life on the Frontline: Facing My Fears', 'In February 2018, Linda Cruse was asked to run a Just over a year ago Linda Cruse was leading a mission to the village of Thangdor in Nepal, devastated by the earthquake. The road to the village had been swept away in a landslide and she found herself frozen with fear on the side of a mountain.', 'Active', '2018-05-21 19:29:34', '2018-05-21 19:29:34', '2018-03-14 07:00:00', 'R4G-1526905771.jpg', NULL, 'https://mailchi.mp/815b485c8906/linda-cruse-how-vulnerability-became-a-strength', NULL, NULL),
(17, 'Race4Good: 1 Challenge, 3 Teams, 4 Hours', 'In February 2018, Linda Cruse was asked to run a Race4Good mini workshop to address the serious issue of food insecurity in Vail, Colorado. Fellow TEDx speakers and key local residents came together to form dynamic teams; they had four hours to find a solution - but could it be done?', 'Active', '2018-05-21 19:30:54', '2018-05-21 19:30:54', '2018-02-08 07:00:00', 'R4G-1526905854.jpg', NULL, 'https://mailchi.mp/b22f5b2ee017/race4good-1-challenge-3-teams-4-hours', NULL, NULL),
(18, 'Linda Cruse: Three Day Old Urine!', 'I am in a yurt in the middle of nowhere in the High Himalayas, the wind is howling outside, it\'s freezing cold and pitch black.&nbsp; &nbsp;I am invited to drink three-day-old urine - find out why:&nbsp;&nbsp;<a href=\"https://www.youtube.com/watch?v=0nkJiCDQT90&amp;t=36s\">TED TALK</a>', 'Active', '2018-06-12 14:17:05', '2018-06-12 14:17:05', '2018-06-12 07:00:00', 'R4G-1528787825.jpg', NULL, NULL, NULL, NULL),
(19, 'Linda Cruse: Surviving a Typhoon', 'From early 2014,&nbsp;<span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-GB;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">Linda Cruse spent two years\r\nin a remote village in the Philippines helping a community bounce back after it\r\nwas devastated by Typhoon Haiyan.</span>', 'Active', '2018-07-09 16:55:11', '2018-07-09 16:55:11', '2018-07-09 07:00:00', 'R4G-1531130111.jpg', NULL, 'https://mailchi.mp/c20b345e4375/linda-cruse-surviving-a-typhoon', NULL, NULL),
(20, 'Linda Cruse: The Courage to Make a Difference', 'Video capturing the frontline experience in Nepal of Elsa Renton from GSK in New Zealand.', 'Active', '2018-10-23 23:09:03', '2018-10-23 23:09:03', '2018-10-22 07:00:00', 'R4G-1540310943.jpg', 'Linda Cruse', 'https://www.youtube.com/watch?v=zP7lu7Z9_Wk', NULL, NULL),
(21, 'Linda Cruse: Courageous Leadership', 'This blog was recorded by Elsa Renton of GSK who recalls her profound Be The Change experience in Nepal in July 2018.', 'Active', '2018-10-23 23:11:21', '2018-10-23 23:11:21', '2018-09-13 07:00:00', 'R4G-1540311081.jpg', 'Linda Cruse', 'https://mailchi.mp/facbeee2357b/linda-cruse-courageous-leadership', NULL, NULL),
(22, 'Linda Cruse: What The Asian Tsunami Taught Me', 'While working in Thailand after the Asian Tsunami, Linda unexpectedly found inspiration in the words of a former colleague.', 'Active', '2019-02-05 19:38:01', '2019-03-15 18:25:48', '2019-03-15 07:00:00', 'R4G-1552649148.jpg', NULL, 'https://mailchi.mp/e30d858584b3/what-the-asian-tsunami-taught-me', NULL, NULL);
