(201, 'Shintaro Nakagawa (Shin)', 'shintaro.nakagawa@unilever.com', '+81-80-2195-6532', 'Japan', 'Dear whom it may concern,\r\n\r\nExcuse me for this sudden e-mail.  I\'m Shin leading the Marketing function in a FMCG company Unilever Japan. I recently heard very positive comments about the training programs you are offering and wanted to ask you to take me through the program overview if possible.  Actually my wife was one of the judges in the program Linda has run recently in GSK Japan and she\'s my source of information :).  As you might know, Unilever as a company is rooted on social purpose and being able to incorporate that into  business and/or leadership training would be ideal for us.  To clarify this is not a global initiative but coming out of Unilever Japan.  Appreciate if you could get back to me at your earliest convenience.\r\n\r\nThanks.\r\nShin', 'contact', 'R4G for Business', NULL, NULL, '2019-10-15 15:27:20', '2019-10-15 15:27:20'),
