ou decide not to pay, we will start the attack at the indicated date and uphold it until you do, theres no counter measure to this, you will only end up wasting more money trying to find a solution. We will completely destroy your reputation amongst google and your customers.\r\n\r\nThis is not a hoax, do not reply to this email, dont try to reason or negotiate, we will not read any replies. Once you have paid we will stop what we were doing and you will never hear from us again!\r\n\r\nPlease note that Bitcoin is anonymous and no one will find out that you have complied.', 'contact', 'Volunteering', NULL, NULL, '2020-07-02 01:58:14', '2020-07-02 01:58:14'),
