INSERT INTO `members` (`id`, `name`, `email`, `designation`, `bio`, `business`, `image`, `phone`, `address`, `twitter`, `facebook`, `linkenid`, `slug`, `type`, `member_stone_id`, `meta_title`, `meta_description`, `deleted_at`, `remember_token`, `created_at`, `updated_at`) VALUES
(1, 'MARY MILLS-BROWN', NULL, 'OPERATIONS MANAGER', 'A highly experienced HR, logistics and international events manager with over 30 years experience. Mary was a member of the military police for seven years and went on to work for the British Royal Family and a renowned UK businesswoman in London.&nbsp; &nbsp;Mary was a director at an international charity specialising in youth empowerment before joining Linda Cruse full time.', NULL, 'marymills-brown-members55', NULL, NULL, NULL, NULL, NULL, 'marymills-brown-members55', 'Team', NULL, NULL, NULL, NULL, NULL, '2017-11-12 16:54:11', '2019-02-03 17:19:12'),
(3, 'FADZAI MARANGE', NULL, 'FRONTLINE ASSISTANT, RACE4GOOD', 'Fadzai Marange is passionate about impacting lives positively. Fadzai is a biomedical scientist with an Executive MBA and a Masters in Public Health. Fadzai is a great believer in impacting communities by actively participating to make a difference. Outside her normal work she volunteers with a number of organisations to help change lives.', NULL, 'mingmasherpa-members13', NULL, NULL, NULL, NULL, NULL, 'mingmasherpa-members13', 'Team', NULL, NULL, NULL, NULL, NULL, '2017-11-12 16:55:36', '2017-12-19 16:56:00'),
(4, 'RITA CIOLEK', NULL, 'FILM DIRECTOR, PRODUCER', 'Rita Ciolek immigrated to the United States from Poland in 1995. She earned a Bachelor of Science in Commerce with High Honor from DePaul Universitys College of Commerce in 2001, at the same time as earning her certification as a CPA. Rita worked for PricewaterhouseCoopers in the tax group and later at Abbott Laboratories where she worked until she started Kazia Productions.   Driven by a desire to combine her entrepreneurial spirit with her creative side, Rita went back to DePaul University, and in 2015 earned a Master of Fine Arts in Cinema from its School of Cinematic Arts. At Kazia Productions, Rita combines her passion and training in storytelling with the knowledge and skills she earned from her thirteen years of experience working with major corporations. Her boutique media production company creates interesting and exciting digital media with emphasis on human interest and social impact stories. Ritas notable film works include Jax, which won a Best Documentary award at the 2014 DePaul University Premiere Film Festival.  Recently, Rita teamed up with Linda Cruse, the renowned frontline humanitarian, to direct a documentary film about Race4Good  a hand up revolution birthed to tackle life-threatening challenges in devastated communities around the globe.', NULL, 'ritaciolek-members57', NULL, NULL, NULL, NULL, NULL, 'ritaciolek-members57', 'Team', NULL, NULL, NULL, NULL, NULL, '2017-11-12 16:56:14', '2017-12-19 16:56:52'),
(5, 'Alexa Libro', NULL, 'UCLA Student Lead', '<p>I could probably write five pages about how amazing everyone on this journey was and how my life is forever changed by being part of the Race4Good. Thank-you Linda for showing me how to Be the Change! The race and the trip both dramatically increased my confidence in cross cultural communication and I now understand that if you take the time to learn about another communitys culture, you can truly make an impact. This experience will carry over into my future work. All I do is talk about my experience and how I felt like we were truly making a difference. Im recommending it to everyone I know! </p>', 'UCLA Student Lead', 'alexalibro-members35', NULL, NULL, NULL, NULL, NULL, 'alexalibro-members35', 'Testimonial', NULL, NULL, NULL, NULL, NULL, '2017-11-13 12:02:51', '2017-11-21 11:43:12'),
(6, 'Megan Roach', NULL, 'City of Beverly Hills', '<p>Linda Cruses Race4Good is an innovative programme that harnesses the brain power of university students with support from business leaders to create sustainable solutions to truly help third world communities in need. As a business leader, I had the opportunity to mentor a group of students who were bright, thoughtful and talented. Through the Race4Good experience I realised how much I enjoy working with students to help them reach their potential as leaders. I am now exploring other opportunities to teach and mentor students in local government and non-profit sectors. </p>', 'City of Beverly Hills', 'meganroach-members63', NULL, NULL, NULL, NULL, NULL, 'meganroach-members63', 'Testimonial', NULL, NULL, NULL, NULL, NULL, '2017-11-13 12:03:37', '2017-11-17 15:48:37'),
(7, 'Sue Stevenson', NULL, 'CEO, Lifted Fog, LLC', '<p>I was so honoured to be invited to take the role of chair of judges in the Race4Good competition. I am so glad that our efforts to leave a positive footprint were felt - it was a top priority. I am sure that the winning team will listen, learn and be fully present for the trip to Nepal to implement their ideas. </p>', 'CEO, Lifted Fog, LLC', 'suestevenson-members15', NULL, NULL, NULL, NULL, NULL, 'suestevenson-members15', 'Testimonial', NULL, NULL, NULL, NULL, NULL, '2017-11-13 12:07:04', '2017-11-13 12:07:04'),
(8, 'Charles Black', NULL, 'Hilton and Hyland', '<p>What surprised me was the impact we could have in such a short time with life-changing results for a community half way across the globe.&nbsp; Race4Good is an amazing development tool for employees and an amazing recruitment tool for young millennials for whom helping others is an important aspect of their lives.&nbsp; From a business perspective, to allow your employees to focus on something besides the bottom line for the company, I think says a lot about the business.&nbsp;&nbsp; Any business considering being involved in Race4Good should know that the impact you are going to leave on your employees, they will remember for the rest of their lives and that will be associated with your company.&nbsp;&nbsp; The experience I had will be a highlight of my career here at Hilton &amp; Hyland and something I will never forget.\"<br></p>', 'Hilton and Hyland', 'charlesblack-members80', NULL, NULL, NULL, NULL, NULL, 'charlesblack-members80', 'Testimonial', NULL, NULL, NULL, NULL, NULL, '2017-11-13 12:07:40', '2018-02-27 16:07:18'),
(9, 'Rohan a`Beckett', NULL, 'Wanda Beverly Hills Properties, LLC', '<p>The team from UCLA who won the Race4Good competition demonstrated all the qualities that professionals in business hope to see in fresh graduates: team work, initiative, problem solving, and time management. Their ability to come up with a feasible and realistic plan in such a challenging environment goes beyond just beyond critical thinking, it demonstrates the strong empathy the students showed to the village in Nepal. I think it was their passion to help that ultimately led to their success. This is going to be an experience that these young people will draw inspiration from throughout the rest of their lives, and will leave a powerful impact on the lives of an entire community.</p>', NULL, 'rohana60beckett-members55', NULL, NULL, NULL, NULL, NULL, 'rohana60beckett-members55', 'Testimonial', 1, NULL, NULL, NULL, NULL, '2017-11-13 12:08:22', '2017-12-05 13:24:55'),
(10, 'Morgan Fisher', NULL, 'Solar Director', '<p>Great Job Linda and the UCLA team. I am so very grateful to be able to hear about progress - the villagers in Thangdor are off to a great start! What a wonderful race - can\'t wait for the next one. Amazing work you are doing. </p>', 'Solar Director', 'morganfisher-members35', NULL, NULL, NULL, NULL, NULL, 'morganfisher-members35', 'Testimonial', NULL, NULL, NULL, NULL, NULL, '2017-11-13 12:09:11', '2017-11-13 12:09:11'),
(12, 'Ryan Robles', NULL, 'CSUN Student Lead', '<p>I just want to say thank you to everyone in the Race4Good! We put everything we had into this business idea and we are proud of our final product. Unfortunately, we did not win but in the end the village is going to get the hand-up it needs. Thank you all for helping us! If I could do it all over again I wouldn\'t change a thing. I\'m proud of the CSUN team! </p>', 'CSUN Student Lead', 'ryanrobles-members98', NULL, NULL, NULL, NULL, NULL, 'ryanrobles-members98', 'Testimonial', NULL, NULL, NULL, NULL, NULL, '2017-11-13 12:10:18', '2017-11-17 15:44:51'),
(13, 'Karen Emanuel', NULL, 'Managing Director,', '<p>I would never have imagined that my professional expertise could have been so\r\n                                            useful, applied in a vastly different environment to my day to day life. The\r\n                                            transformation I witnessed in the remote Himalayan community will stay with\r\n                                            me forever. I saw families, who had no hope, empowered with a\r\n                                            sustainable future, confident that they could put food on the table and\r\n                                            their children would be educated. Linda is an expert,\r\n                                            an inspiration and a seamless facilitator. A must experience for anyone who\r\n                                            wants to feel that depth of sustainable contribution and far better\r\n                                            than any traditional development training experience. </p>', 'Key Production, UK', 'karenemanuel-members60', NULL, NULL, NULL, NULL, NULL, 'karenemanuel-members60', 'Testimonial', 23, NULL, NULL, NULL, NULL, '2017-11-14 14:42:10', '2017-11-16 11:51:49'),
(15, 'Nimasai', NULL, 'Village elder', '<p>\r\n                                        My dear brothers and sisters what Race4Good has provided us is beyond our dreams.  Now two years since the earthquake and no help from government or charities.   We live in a remote area, forgotten.</p>\r\n                                    <p>\r\n                                        We are simple people and we just want to earn enough money to be independent, to feed our\r\n                                        families, send our children to school and save some money for sickness and old age. You came\r\n                                        here wanting to understand our way of life, bringing new business ideas and seeing how they\r\n                                        may help us to become stronger and more resilient. The earthquake hit us hard. So many of\r\n                                        the families want to start these new projects of bee-keeping, bamboo growing, apple planting.\r\n                                    </p>\r\n                                    <p>\r\n                                        We are excited and will not let you down. You have shown us what is easy and what can be\r\n                                        profitable. We will work hard to make it a success.  Please come back and you will see.\r\n\r\n                                    </p>', 'Thangdor, Nepal', 'neemasi-members74', NULL, NULL, NULL, NULL, NULL, 'neemasi-members74', 'Testimonial', 2, NULL, NULL, NULL, NULL, '2017-11-19 17:21:55', '2017-11-28 14:57:15'),
(16, 'ROBERT TUNMORE', NULL, 'FRONTLINE LEADER, RACE4GOOD', 'Robert Tunmore is an experienced BTC ambassador supporting the programme since meeting Linda in 2012 and has taken part in several\r\nprogrammes in Nepal. Robert has held\r\nseveral senior university positions in the United Kingdom; worked at the\r\nDepartment of Health England on the Chief Nursing Officers Professional\r\nLeadership Team and currently works with NHS England. He is\r\na registered mental health nurse and general nurse.', NULL, 'roberttunmore-members81', NULL, NULL, NULL, NULL, NULL, 'roberttunmore-members81', 'Team', NULL, NULL, NULL, NULL, NULL, '2017-12-18 19:10:24', '2018-03-11 14:57:47'),
(18, 'CATHY BOUTIN', NULL, 'DESIGNER', 'Cathy Boutin is Director of Marketing Programmes at Concept Communications and brings over 15 years of experience in marketing and research for Healthcare and Life Science companiesincluding HP Healthcare, Cambridge Research and Instrumentation, Merck, and the Dana Farber Cancer Institute. She has experience in driving market penetration for high-end technology, products and services to a wide array of specialties and disciplines.  Cathy has contributed enormously to Lindas work through website design, marketing materials and branding.', NULL, 'cathyboutin-members55', NULL, NULL, NULL, NULL, NULL, 'cathyboutin-members55', 'Team', NULL, NULL, NULL, NULL, NULL, '2017-12-19 16:21:16', '2018-03-11 14:58:10'),
(26, 'KAT HABER', NULL, 'TEDxVail Organiser', '<p>Linda Cruse is a magical genius. The Race4Good mini workshop had impact on the problem of fully feeding families in the Vail Valley. Teams of TEDxVail speakers provided innovative thinking for solving the challenge for the hard working, underfed residents of Eagle County, Colorado. Using business brains to generate original solutions, the winning team is already eager to turn their plan into a reality. We can imagine employing this original process for many more adventures to come, focusing on housing, health, and happiness. TEDxVail is proud to be part of this fun, impactful game. Play on! </p>', NULL, 'kathaber-members18', NULL, NULL, NULL, NULL, NULL, 'kathaber-members18', 'Testimonial', NULL, NULL, NULL, NULL, NULL, '2018-03-08 12:21:12', '2018-03-08 12:53:37'),
(27, 'ANJANA NARAIN', NULL, 'General Manager, GSK', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align: left;\">Race4Good was a transformative experience for not just the young talents at GSK but also their coach leaders.\"<br></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><br></p>', 'GlaxoSmithKline', 'anjananarain-members23', NULL, NULL, NULL, NULL, NULL, 'anjananarain-members23', 'Testimonial', NULL, NULL, NULL, NULL, NULL, '2019-02-02 20:19:00', '2019-02-02 20:47:27'),
(28, 'Nobuhito Kittaka', NULL, 'Manager, GSK', 'The Race4Good was the most powerful leadership programme I have ever taken!', 'GlaxoSmithKline', 'nobuhitokittaka-members47', NULL, NULL, NULL, NULL, NULL, 'nobuhitokittaka-members47', 'Testimonial', NULL, NULL, NULL, NULL, NULL, '2019-02-02 20:31:58', '2019-02-02 20:48:34'),
(29, 'KAREN EMANUEL', NULL, 'Owner, Think Tank Media', 'Race4Good: I loved taking part in such a fun, fast-paced and outcome driven race, where I got to share my skills/innovation to practically uplift the BVI community. Loved being put in teams with members of the local community and students  what an honour!  A great end to a great week. Where else do you find cultural and community immersion programmes like this around the world? An unforgettable experience laced with meaning and purpose.\"', 'Think Tank Media', 'karenemanuel-members97', NULL, NULL, NULL, NULL, NULL, 'karenemanuel-members97', 'Testimonial', NULL, NULL, NULL, NULL, NULL, '2019-02-02 20:37:56', '2019-02-02 20:50:13'),
(30, 'BETH SHAFER', NULL, 'Owner, Current Events Co.', 'The Race4Good brought together a group of people from varied career and socioeconomic backgrounds, to brainstorm and come up with concrete solutions to the serious problem of food insecurity in Vail, Colorado. In fact, it was precisely this formula that was the key to success! With so many different personalities and experiences coming together, there is no other option than to think outside-the-box.  It was transformational, inspiring, and gave each participant such a euphoric sense of accomplishment.', 'Current Events Company', 'bethshafer-members13', NULL, NULL, NULL, NULL, NULL, 'bethshafer-members13', 'Testimonial', NULL, NULL, NULL, NULL, NULL, '2019-02-02 20:46:13', '2019-02-02 20:49:12'),
(31, 'PENNY GODFREY', NULL, 'Frontline Manager', 'With a successful corporate background in Marketing and PR, Penny has worked in an independent school for the last seven years. She manages the schools website, publicity and communication and, alongside Linda, has developed the Linda Cruse International Schools Programme. She is passionate about the educational benefit of these experiences having enjoyed her first BTC trip several years ago.', NULL, 'pennygodfrey-members82', NULL, NULL, NULL, NULL, NULL, 'pennygodfrey-members82', 'Team', NULL, NULL, NULL, NULL, NULL, '2019-02-03 17:11:44', '2019-02-03 17:11:44');
