INSERT INTO `news_resources` (`id`, `title`, `author_name`, `published_date`, `event_date`, `content`, `category`, `file_name`, `file_url`, `file_type`, `order`, `doc_name`, `slug`, `meta_title`, `meta_description`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'Radio Interview with Linda Cruse by Kitty Waters', 'Kitty Waters', '2017-04-21', NULL, '<p><span style=\"color: rgb(51, 51, 51); font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">Our guest today is an international aid worker, disaster management specialists and has over 15 years of front line humanitarian aid work. Her work has taken her into every continent on the planet.</span><br></p>', 0, 'radiointerviewwithlindacrusebykittywaters-news-resources50', 'http://kitty-talks.libsyn.com/kitty-talks-to-linda-cruse', 0, NULL, NULL, 'radiointerviewwithlindacrusebykittywaters-news-resources62', 'Radio Interview with Linda Cruse by Kitty Waters', 'Radio Interview with Linda Cruse by Kitty Waters', NULL, '2017-11-13 12:25:37', '2017-12-08 18:03:31'),
(2, 'Volunteering in a brave new world', 'John McCrone', '2015-03-15', NULL, '<p></p><p>\r\n									          				What\'s that? A group of top Christchurch business leaders and students are going to be Skyping village elders deep in the Amazonian rain forest or high up the Atlas Mountains in Morocco, offering their skills to nut out some local problem?</p><p>\r\n									          			</p>\r\n									          			<p>\r\n									          				Is this woman for real? Is this the way we are going to save the planet now?\r\n									          			</p>\r\n									          			<p>\r\n									          				Linda Cruse, a UK nurse turned freelance humanitarian aid worker who hobnobs with the likes of Sir Richard Branson - she once held the dunny door shut for him when they both had funny tummies at a Sowetan refuge camp - is passing through Christchurch as the University of Canterbury\'s (UC) social entrepreneur in residence.\r\n\r\n									          			</p>\r\n<p>The university makes no bones about why they went to some lengths to recruit her. Post-quake in particular, the way to be cool with the kids, attract students to Canterbury rather than Victoria or Dunedin, is to exploit that student volunteer army brand.</p>\r\n									          			<p>Come to UC where community involvement can become a big tick on your CV. And so this May, Cruse will be launching the grand finale of her residency - the UC 21 Day Challenge.\r\n</p>\r\n									          			<p>\r\n									          				But as Cruse told a Ministry of Awesome audience last week in launching the challenge, her own story - which is already a book, Marmalade and Machine Guns, and set to become a movie by the producer of Downton Abbey - is also rather remarkable.\r\n									          			</p>\r\n									          			<p>\r\n									          				The tale begins with her driving home on a motorway and being struck blind. She was a nurse turned pharmaceutical rep in England, divorced with two near adult children, living a stressed and pointless life.\r\n									          			</p>\r\n									         			<blockquote>\r\n									         				\"It was after a sales conference, a dark winter\'s night. I had this stabbing pain come behind my eyes. All of a sudden the curtains came down.\"\r\n									         			</blockquote>\r\n									          			<p>\r\n									          				Somehow, she says, she made it to the hard shoulder and sat there for a couple of hours while she recovered. But that incident left her with the resolve to sell her possessions, chuck it all in, simply go out into the world and help others.\r\n\r\n\r\n									          			</p>\r\n									          			<p>\r\n									          				With the advantage of her nurse training, a 40 year old Cruse soon found herself doing organised aid work - teaching hygiene in back country China.\r\n									          			</p>\r\n									          			<p>\r\n									          				Then she worked in a Tibetan refugee camp across the border in India where one of her jobs became to broker internships and job experience for young Tibetan\'s struggling to find work in a new country.\r\n									          			</p>\r\n									          			<h4>\r\n									          				CONNECTED WORLD\r\n\r\n									          			</h4>\r\n									          			<p>\r\n									          				On Boxing Day 2004, Cruse happened to be in Tashkent, Uzbekistan, with five years of hopping from one aid mission to the next under her belt, when news of the Asian tsunami began to unfold on her battered laptop.\r\n									          			</p>\r\n									          			<p>\r\n									          				That led to another impulsive decision. She bought a plane ticket for the next flight to Thailand.\r\n									          			</p>\r\n									          			<p>\r\n									          				Cruse says emergency aid situations like natural disasters and wars are meant to be handled by United Nation agencies, the military, heavy duty organisations like the Red Cross. However in a connected world, she felt she had to go.\r\n\r\n									          			</p>\r\n									          			<p>So she arrived at the tourist resort of Phuket and made a chaotic taxi ride to the worst hit area of Khao Lak, bluffing her way through the police cordons by posing as a member of a forensics team.\r\n</p>\r\n						<p>But once she made it there, looked over a cliff and saw the dead bodies washed along the shoreline, tangled in the trees, Cruse knew she was out of her depth. \"I came back from the edge of the cliff and collapsed. I couldn\'t speak.\"</p>\r\n						<p>\r\nA vision of her old nursing matron telling her to pull herself together got her to a makeshift emergency camp where a volunteer doctor from Singapore put her to work bandaging wounds, a woman from Wisconsin recruited her to help with a tent of orphaned children.</p>\r\n						<p>Cruse found she wasn\'t alone. It turned out others had been triggered to direct action by social media too.</p>\r\n						<p>\r\n							Of course, the official aid machinery is still absolutely necessary she says. Only it has the cargo planes, the portable hospitals, the government connections, the scale. Yet the global sense of immediacy, when everything on the planet feels like it is being captured on someone\'s smartphone, is changing the aid world.\r\n						</p>\r\n						<p>\r\n							She gives an example. Cruse had a surprise when she was contacted by Cadbury-Schweppes who decided it was going to shift an annual meeting - a sales jolly - to any hotel in Phuket left standing.\r\n						</p>\r\n						<blockquote>\r\n							\"They were about to go to Mexico. But the company asked if I could facilitate a hundred of its country managers to spend two days helping the Thai people recover. They wanted to demonstrate that the Thais had friends and support. They wanted to put money into the area\'s economy because after the disaster the tourism had all disappeared.\"\r\n						</blockquote>\r\n						<p>\r\n							Another unlikely sounding initiative was her own - to ask the UK Magic Circle to rush out a children\'s entertainer.\r\n\r\n\r\n\r\n\r\n\r\n						</p>\r\n						<p>\r\n							Cruse says the idea came when she had been at the 5000-strong emergency camp only a few days while phoning her father, who happened to be a magician. One arrived within a fortnight, complete with dickie bow and balloon animals.\r\n						</p>\r\n						<p>\r\n							Cruse says it sounds wrong but the camp children needed a distraction from the horrors. \"He became their Pied Piper.\" And it made such a difference that a travelling circus, with stilt walkers, fire eaters and clowns, eventually followed.\r\n						</p>\r\n						<p>\r\n							This showed Cruse that aid organisations are formal and lumpy in their thinking by necessity. But if you are on the ground, and you have a mobile phone, then a far more spontaneous reaction to disaster situations is possible.\r\n\r\n						</p>\r\n						<h4>\r\n							A REAL DIFFERENCE\r\n						</h4>\r\n						<p>\r\n\r\nCruse says her second big realisation from the tsunami is that the emergency agencies start pulling out after a couple of months. There is always another crisis to get to. Locals are then left in a shattered landscape, their fields and livelihoods gone, with no clear direction on how to rebuild.\r\n\r\nIt was here Cruse felt she could make a real difference. And it seemed a simple equation.\r\n</p>\r\n<p>\r\n	In Khao Lak, 90 per cent of the locals had worked in the hotels and now 90 per cent of those hotels were gone. What they needed was mentorship, business advice, to help them get back on their own feet.\r\n\r\nAfter an email, Cruse got instant backing from the Prince of Wales International Business Leaders Forum in London. In April 2005, 15 corporate bosses from Nestle, Deloitte and others arrived to see things for themselves. The Thai Navy provided two helicopters to ferry them around.\r\n</p>\r\n<p>\r\n	Again, Cruse says, it sounds swish and high-flying. But it led to the establishing of a network of contacts in which individual Thai villagers who might have lost everything were helped to set up a home laundry business, small backyard petrol dealership, or mobile catering service\r\n\r\nOn a larger scale, the local fishermen whose boats had been smashed and so could not fish were organised to become boat- builders themselves. And local rubber plantations which had been abandoned when the tourist hotel industry came were also revived.\r\n</p>\r\n<blockquote>\r\n	\"All the villagers required was a coconut shell, a knife to scour the tree, and a mangle which cost $200. In four months, they were earning three times the money they had been getting in the hotels,\"Cruse says.\r\n</blockquote>\r\n<p>\r\n	Cruse had her model. But she still had a lot to learn. She soon discovered the Thais as a nation had been particularly welcoming of outside aid. It was rather different when she flung herself into her next disaster, the 2005 Kashmir earthquake where 75,000 died.\r\n\r\nCruse arrived in Pakistan to find - even wearing a burka and going as native as possible - that operating on the border of the war in Afghanistan, was just too dangerous for an unsupported foreigner. Official aid workers were being kidnapped, their hotels blown up.\r\n</p>\r\n<p>\r\n	The military offered her an armoured car and armed escort, but it became clear that taking part of the earthquake recovery itself was going to be impossible.\r\n\r\nCruse instead went to the province of Sindh to test out her new mentorship approach there. She had been talking with the business community in Karachi and found it was too worried for its own safety to travel to the poor countryside. \"If you were rich, you risked being kidnapped and ransomed.\"\r\n\r\n</p>\r\n\r\n<p>\r\n	But some of these company bosses ran the country\'s dairy industry. \"They had a huge demand for milk yet couldn\'t access it.\" So she developed a project where Cruse worked on the ground in Sindh to establish a new farmers co-operative.\r\n</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n	It was facilitating a change. \"When I met these farmers, it was quite extraordinary. They had the cows out in 50 degree heat. And tethered so they couldn\'t drink. So you can imagine the amount of milk they were producing.\"\r\n\r\nInvestment paid for shade, water troughs and better food. There was a measuring of milk solids to get around the farmers\' habit of watering down the milk. And the farmers were paid daily when the milk tanker called so they in turn came to trust the co- operative.\r\n</p>\r\n<h4>\r\n	THE NEED TO LISTEN\r\n\r\n</h4>\r\n<p>\r\n	\r\nFrom Pakistan, Cruse continued to travel the world, knitting together these kinds of connections and projects. She formed her own Be the Change Foundation where she started taking groups of four or five business leaders - \"self-made millionaires and chief executives\" - to remote villages.\r\n\r\n</p>\r\n<p>\r\nA recent trip was to Nepal. Cruse says it turned out the village women were throwing out old leather shoes that could be reworked into belts to sell in Kathmandu\'s tourist markets.\r\n\r\nThe trips are something of a Dragons\' Den in reverse. \"At the end of three days, the business leaders have to produce a viable business plan. And they are competing against each other, so of course they do their best.\"</p>\r\n<p>\r\nHer journeys have not always gone smoothly. One episode sure to feature in any film is when Maoist rebels in Nepal captured her and her guide on a motorbike in the forest. They managed to escape - shots whistling over their heads - after the rebel band got drunk and insensible around the camp fire later that night.</p>\r\n<p>But Cruse says by continually plunging in, she has learnt important lessons. Like the need to listen rather than immediately impose solutions from an outsider\'s perspective.\r\n\r\nShe was working with one Moroccan village that lacked every basic. But what the people wanted was not sewers or teachers but a hamman or Turkish sauna.</p>\r\n<p>\"As Muslims, they had to wash five times a day and it\'s cold in the mountains.\" A hammam was also a place people could meet and talk. So in reality, it was a community centre they were asking for.</p>\r\n<p>A similar thing in Kenya\'s Maasai Mara where a foreign aid organisation wanted to give the village a water pump. Cruse says the women smiled politely because they felt they couldn\'t say no. But when she got them alone for more careful questioning, they told her they loved the long walk to the river because it was the part of the day they got to gossip. Please, think of something else.\r\n</p>\r\n<p>Discovering how another community ticks is what is going to make the coming 21 Day Challenge an interesting competition, Cruse say. \"You have to learn to walk in their moccasins.\"</p>\r\n<h4>\r\n	SMART THINKING\r\n\r\n\r\n\r\n\r\n</h4>\r\n<p>\r\n	\r\nCruse confesses she sometimes gets cynical reactions to her work. Yes, people say, it is valuable. But how much of an impact can you really make when the world is such a large place?\r\n\r\nAnd social entrepreneurship is achingly hip. Which universities are not adding it to their business courses to create a fashionable addition to a CV?\r\n</p>\r\n<p>\r\n	However, Cruse repeats, it is not about treating traditional aid as redundant. The world still needs the familiar organisations turning up in a crisis. And even managing the regular development programmes.\r\n\r\nBut this is about the rapidly growing possibility for direct personal involvement. And about recognising the world has to spread its smart thinking as much as its money, food and medicines.\r\n\r\nAs she concluded in her talk to the Ministry of Awesome - part of Christchurch\'s own social response to the earthquake recovery: \"Contribution is the greatest human need.\r\n\r\n</p>\r\n<blockquote>\r\n	\"And it doesn\'t have to be like me - give up your whole life. Literally, it can be an hour a month.\"\r\n</blockquote>\r\n                                            <p></p>', 0, 'volunteeringinabravenewworld-news-resources87', '', 0, NULL, NULL, 'volunteeringinabravenewworld-news-resources55', 'Volunteering in a brave new world', 'Volunteering in a brave new world', NULL, '2017-11-13 13:41:16', '2018-01-18 16:23:11');
INSERT INTO `news_resources` (`id`, `title`, `author_name`, `published_date`, `event_date`, `content`, `category`, `file_name`, `file_url`, `file_type`, `order`, `doc_name`, `slug`, `meta_title`, `meta_description`, `deleted_at`, `created_at`, `updated_at`) VALUES
(3, 'Thiland: The Ripple-Effect', 'Linda Cruse', '2005-02-01', NULL, '<em>How an economic hand up for one family created a powerful ripple-effect across the community.</em> 									 			<p>									 				Khun Ban Bongliu lives in Thailand with her husband and their daughter, Khun Puk, aged eight. The family home is near Khao Lak, a series of villages about 55 km north of Phuket on the south-west coastline. Khao Lak has a population of about 35,000 and most of the inhabitants are employed by the tourist trade. 									 			</p>									 			<p>									 				A couple of years ago, Khun Bans husband was involved in a car accident which resulted in him having a foot amputated. He has been depressed and unable to work since; he does what he can to contribute, but it is difficult for him. Khun Ban is now the sole provider and works in a local beachside resort as a cook. The hours are long and the pay is low, but Khun Ban is grateful that work is available throughout the year enabling her to earn USD140 in a good month. 									 			</p>									 			<p>										 			At the time when the tsunami struck, Khao Lok was beginning to make its mark as a peaceful, low-key alternative to the increasingly brash resorts to the south. Popular with those who wanted space and peace, including Thai royalty. 										 		</p>									 									 			<p>									 				Its now 26th December 2004 and Khun Ban is enjoying a rare day off work, although there are plenty of things for her to do around the house. Her village is situated a couple of kilometres inland at the foot of a large hill and in a deep jungle setting. The family home is a simple one-story structure made of concrete, sparsely furnished but noticeably neat and tidy. 									 			 									 			</p>									 			<p>									 				Just before 10 am, Khun Ban is standing at the village pump doing the familys washing, unaware of the horror unfolding out to sea. In just a few minutes time her village and the whole region will be hit by one of the worst natural disasters in living memory. 									 			</p>									 			<p>									 				Just before 8 am a powerful earthquake strikes the coast of Sumatra in Indonesia. Two hours later the resulting tsunami reaches Thailand, continuing its devastating journey across the region. Tourists are enjoying a tranquil morning on the beach when they witness the sea retreating rapidly from the shore. Children scream with excitement and families call out to each other to watch the phenomenon, not realising the sea will return, bringing with it widespread death and destruction. Those who eventually realise the significance flee in terror, but for hundreds it is too late - between 5,000 and 8,000 people will die in Thailand - in Kao Lak alone, 4,000 will perish. 									 			</p>								 									 			 									 			 									 			<p>									 				<img src=\"data:image/jpeg;base64,\" data-filename=\"Thailand-Tsunami.jpg\" style=\"width: 25%; float: left;\">Back in her village, Khun Ban heard what she later described as a monster, the roaring sound of the tsunami as it edged closer, the screams of nearby friends and neighbours and the horrific vibration in the ground around her. Not knowing exactly what was coming, but sensing she and her family were in grave danger, Khun Ban called to her husband and helped him and their daughter reach higher ground. The three of them watched the horror unfold beneath them, unable to comprehend what they were seeing. 									 			</p>									 			<blockquote>\r\n									         				It is impossible to forget the monster, the beast, remarks Khun Ban, a watermark just below the ceiling of our home is a constant reminder.   The hungry wave devoured all our possessions, our clothes, my daughters school books  our food, our beds, smashed, washed away, gone.  But compared to others, we were lucky.\r\n									         			</blockquote> 									 	 									 			<p>									 				In the days that followed, Khun Ban and her husband walked around in a daze, salvaging just a few of their possessions. Khun Ban was horrified to learn that the hotels on the coastline where she worked, had been completely washed away and scores of people had died including friends, family and colleagues. The low-lying terrain and rustic style buildings had been no match for the powerful tsunami, with its 10 metres-high waves. 									 			</p>									 			<p>Hearing news of the disaster, humanitarian aid-worker, Linda Cruse, immediately flew to Thailand where she began working in a large refugee camp. As part of her long-term, post-disaster work, in true Linda style, she persuaded the British Ambassador to host an event, the purpose to coordinate the efforts of businesses in the region who wanted to help, but did not know how. As a result, Linda and senior leaders from ManpowerGroup, Deloitte, Thai Bev, Nestl, Abbott and the British Embassy formed a unique Be The Change (BTC) team. 									 			</p>									 			 									 			<p>									 				<img src=\"data:image/jpeg;base64,\" data-filename=\"Discussion-of-Community-Uplift-projects.jpg\" style=\"width: 25%;\">Its now early 2005 and the team are being introduced to Khun Ban by the headteacher of the local school. The team meet in the family home, which still bears the scars of the disaster. Khun Ban is dressed in a traditional light cotton batik sarong, tied firmly in a knot around her waist. The strong colours in the fabric, once bold and distinct, now faded to an indistinct grey. Her oversized white t-shirt, frayed and loose, ironically emblazoned with a smiley face  the logo of a local telephone company. The family are clearly traumatised, the three of them huddle close together on the sofa, not allowing even a breath of air to separate them. 									 			</p>									 			<p>									 				The BTC team listen carefully as Khun Ban hesitantly describes the familys situation, how they lost their only source of income and all their possessions, her husband unable to work and how they are finding it difficult to cope with what they have seen and experienced. Khun Bans voice frequently breaks with emotion whilst her husband remains totally silent. The local school teacher finally cuts through the emotion in the room and encourages Khun Ban to tell her story in full. Khun Bans words come out in a torrent whilst in contrast, her daughter remains motionless, like a rag doll, lifeless, eyes wide open staring into space, her head resting on her mothers lap. Noticing the focus of our attention, Khun Ban says softly, she hardly ever talks, she lost so many friends and saw so much. 									 			</p>									 			<p>									 				It was obvious to the team that helping this family must be a slow and careful process but at the same time it was clear Khun Ban was prepared to fight for her family. 									 			</p>									 			<p>									 				In the days that followed, the BTC team began to consider not just Khun Bans family circumstances but the area in which she lived. When the team realised Khun Bans family had access to 500 rubber trees, an amazing business idea began to take shape. Previous generations had been in the rubber tapping industry and the family could make a living by returning to this traditional activity. 									 			</p>									 			 									 			<p>									 				<img src=\"data:image/jpeg;base64,\" data-filename=\"latex-434914_1920.jpg\" style=\"width: 25%; float: right;\">Rubber trees had been imported to Thailand from Malaysia in 1901 and since then rubber has been a significant industry, but in tourist areas rubber harvesting dwindled as local communities went to work in hotels and resorts across the region. Rubber is extracted or tapped with a knife used to carve just the right amount of bark from the tree without damaging it. 									 			</p>									 			 									 			<p>									 				Looking at Khun Bans face, the team knew they were onto a winning idea and over the next few days helped Khun Ban develop a business plan. Further research predicted the business would initially be able to produce up to eight sheets of rubber per day which could be sold in Bangkok for USD1.5 per sheet. The equipment required to start up in business was minimal, two pressing machines, 20 trays and a specialist knife. Total cost: USD300. The equipment was purchased in Phuket with funds donated by ManpowerGroup and Linda was one of the first in the team to attempt harvesting the rubber (pictured). 									 			</p>									 			 									 			 									 			<p>									 				We catch up with Khun Ban and her family in July 2009, four years later. Khun Ban and her husband, pictured with members of the BTC team, are proud to pose for a photograph in front of their rubber harvesting <img src=\"data:image/jpeg;base64,\" data-filename=\"Linda-harvesting-rubber.jpg\" style=\"width: 25%; float: left;\">equipment. Production is going well and Khun Bans husband is delighted that, despite his disability, he is now actively involved in the business. Each night, when the air is cool, he can be found moving from tree to tree, harvesting the sap. The familys income has now increased four-fold and their future is secure. Khun Ban reminds us that the family never wanted a hand out, just an idea and encouragement about how to start again, how to regain their independence and secure their own future. 									 			</p>									 			<p>									 				Both girls are doing well at school and their parents need little encouragement to share extracts from share glowing school reports  the children run around us, lively, happy and carefree. It is almost impossible to believe that the animated twelve-year-old girl in front of us is the same lifeless creature we met four years ago. 									 			</p>									 			<p>									 				The familys new business is so successful, Khun Ban has been able to employ five additional employees but the story doesnt end there! News of the new business spread from one community to the next, right across the coast. Numerous rubber tree plantations, largely dormant when tourism took over, have been revived and are providing a steady, reliable income for hundreds of families across the region. Khun Bans business has had a powerful ripple effect that none of us could have predicted all those years ago. 									 			</p>									 			<h4>									 				ECONOMIC EMPOWERMENT 									 			</h4>									 			<ul>									 				<li>Prior to Be The Change intervention, work in the tourist industry was poorly paid and Khun Ban was earning a maximum of <strong>US$140 </strong> per month.</li>									 				<li>After the tsunami struck, hundreds of families were left homeless and without a way of making a living.</li>									 				<li>Providing Khun Ban with the opportunity to start a rubber tapping business cost just: <strong>US$300</strong>.</li>									 				<li>Through determination and hard work, the familys income is now <strong> US$500 </strong> per month.</li>									 				<li>The business has evolved into a family cooperative and the ripple-effect went right along the coast, one community to the next.</li>									 			</ul>', 2, 'thiland3atheripple-effect-news-resources57', '', 0, NULL, NULL, 'thiland3atheripple-effect-news-resources71', 'Khun Ban Bongliu', 'Khun Ban Bongliu', NULL, '2017-11-13 16:04:49', '2018-07-23 17:53:12');
INSERT INTO `news_resources` (`id`, `title`, `author_name`, `published_date`, `event_date`, `content`, `category`, `file_name`, `file_url`, `file_type`, `order`, `doc_name`, `slug`, `meta_title`, `meta_description`, `deleted_at`, `created_at`, `updated_at`) VALUES
(4, 'Marmalade and Machine Guns', 'Linda Cruse', '2012-08-06', NULL, '<p>									 				<img src=\"data:image/jpeg;base64,\" data-filename=\"book.jpg\" style=\"width: 112.28px; float: left; height: 179px;\"><span style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px;\">In 1996, Linda Cruse, a stressed-out single mum working in a job she hated, was driving along a motorway in the middle of the night when she suffered temporary blindness. This terrifying episode led to a blinding insight: what is the point of living if living has no point? Determined to make a difference, Linda began a new life. This was the start of a scary, lonely, but always emotionally fulfilling job: teaching skills and bringing aid - and, above all, love - to war-torn refugees, the poverty-stricken and the victims of disaster.</span></p><p><a href=\"http://bit.ly/marmaladeandmachineguns\">http://bit.ly/marmaladeandmachineguns</a><br></p>', 3, 'marmaladeandmachineguns-news-resources72', '', 0, NULL, NULL, 'marmaladeandmachineguns-news-resources14', 'Marmalade and Machine Guns', 'Marmalade and Machine Guns', NULL, '2017-11-13 16:24:50', '2017-12-08 16:57:51');
INSERT INTO `news_resources` (`id`, `title`, `author_name`, `published_date`, `event_date`, `content`, `category`, `file_name`, `file_url`, `file_type`, `order`, `doc_name`, `slug`, `meta_title`, `meta_description`, `deleted_at`, `created_at`, `updated_at`) VALUES
(5, 'Niru Kumari Bisunke', 'Linda Cruse', '2016-02-01', NULL, '<em>How an economic hand up brought one family out of darkness and empowered three more.</em>\r\n                                                        <p>Niru Kumasi Bisunke is 26 and the mother of two young children, Simon (6) and daughter Sandhya (5). She lives with her husband, Sajan, in Deuper, a village 90 km east of Kathmandu.; a close-knit, farming community with a population of around 2,000 people. Nirus home is a simple, two-storey house with the family housed upstairs and goats and buffalo below.</p>\r\n                                                        <p>A<img src=\"data:image/jpeg;base64,\" data-filename=\"niru-detail-1.jpg\" style=\"width: 25%; float: left;\"> typical day for Niru involves rising at 5am to clean the house and prepare breakfast, a simple cup of chai tea. Niru then heads to the jungle to collect food for the buffalo, which are milked twice a day and the milk sold at a collection point in the village. At 9, Niru and the children make the 40-minute journey on foot to school, after which she washes the clothes in a nearby spring, tends a small vegetable patch and prepares lunch  usually rice and lentil soup. Each afternoon, Niru seeks works as a porter, transporting bricks using a strap, or namlo, placed on her forehead. It is gruelling work paid according to the weight carried, typically US$4 a day for 30 kg loads. Her husband also looks for manual labour and, when he is lucky enough to find it, earns US$6. At the end of the working day, the family share a dinner of lentils and vegetables and when daylight fades, they sleep on woven bamboo mats and under blankets.</p>\r\n                                                       \r\n                                                        \r\n                                                        <p>On the day of the earthquake, Niru travelled by bus with the children to the beautiful medieval city of Bhaktapur, 90 minutes from home and on the outskirts of Kathmandu. She had hoped to find work in town and, with no hint of the horror to come, felt optimistic and happy. But Niru would soon discover that Bhaktapur was not a safe place to be. When the earthquake struck, the town was less than 50 km from the epicentre and Niru and her children were in grave danger.</p>\r\n\r\n                                                        <blockquote>\r\n                                                            My children and I were inside a shop when the walls started to sway suddenly, shelves and cupboards came crashing down around us.    Screaming, we ran outside into heavy rain and strong winds, tall trees were moving as easily as blades of grass.    It was chaos, people were screaming and I saw buildings crumple like matchboxes, burying people alive.\r\n                                                        </blockquote>\r\n\r\n                                                        <p>Bhaktapur was badly hit; the delicate brickwork of the majestic old city proved to be as fragile as it looked.</p>\r\n                                                        \r\n                                                        <p>Traumatised by what they had seen and unable to reach home, Niru and her children slept outside in the freezing cold, too scared to take shelter anywhere. The aftershocks kept coming, triggering deadly landslides, the collapse of more buildings and further deaths. For four days Niru remained like this; no communication, no way of knowing if her husband was alive, and their only food a handful of broken biscuits.</p>\r\n                                                        \r\n                                                        \r\n                                                        <p>Finally reaching home on foot, Niru and the children were unprepared for the devastation around them. Rushing to the place where her house once stood, Niru was overjoyed to find her husband alive but her relief soon turned to despair when she realised almost all the homes in the village had been destroyed, 25 residents had died and 50 seriously injured. Other than one buffalo and one young goat, Nirus cattle had perished, crushed by falling masonry. Everything the family had worked for seemed lost.</p>\r\n                                                \r\n                                                        <p>In the days following, Niru and Sajan constructed a temporary shelter for their children using whatever materials they could find, wood, bamboo, plastic and tarpaulin. It offered little protection from the elements.</p>\r\n                                                        <p>Our local Be The Change team learnt about the widespread devastation in Deuper through the network of Sherpas who climb the remote Himalayas for a living. In February 2016, the team met Niru for the first time, ten months after the disaster. No government aid had reached the community and to survive, villagers had been forced to trade or sell whatever they could, had foraged for wild food and walked huge distances to seek work. We found Niru and her family still living in their temporary shelter. Niru and her family welcomed the team with wide smiles, but beneath those smiles it was obvious they were haunted by what they had been through.</p>\r\n                                                        <p>Sitting with Niru, her husband, a village leader and Be The Change team, discussions began about how the family could be helped. Niru is a proud woman and quickly made it clear that she would not accept a hand out. So, what could be done to provide Niru with a sustainable, economic hand up, one which would restore the familys hope and generate an income? A few moments later Niru proposed the idea of a candle-making business. In Nepal, large swathes of the country have no electricity or are without power for 16 hours or more a day, a situation which would only get worse following the earthquake. Candles would be in great demand!</p>\r\n                                                        <p>We realised that as an experienced construction worker, Gores skills would be in high demand, particularly as so many buildings across the region had been destroyed or badly damaged. In full consultation with Gore, the village leader, and Be The Change team, it was agreed he should relocate to Kathmandu with his family and our team would help him do this. After so many months of feeling hopeless, Gore was delighted to have the opportunity to provide for his children once again. In his eagerness to relocate he was packed and ready within hours.</p>\r\n\r\n                                                        <p>We asked Niru why she dreamed of running her own business, her reply was simple:</p>\r\n                                                        <blockquote>\r\n                                                                    I will do anything to educate my children and provide for my family.\r\n                                                        </blockquote>\r\n                                                        \r\n                                                        <p>The team helped Niru refine her business idea and, accompanied by a team member, she travelled to the nearest town to purchase equipment and materials. Within the first few days, Niru made 450 candles which she immediately sold at the vibrant, local market.</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"niru-detail-2.jpg\" style=\"width: 25%; float: none;\"><br></p>\r\n\r\n                                                        <p>Twelve months later and we catch up with Niru and her family once again. Business is going well! Niru makes 900 candles per month which means she no longer needs to do manual labour. Furthermore, the activity only requires one hour of her time each morning and evening.</p>\r\n                                                        \r\n                                                        <blockquote>\r\n                                                            Thanks to your belief in me and in my business idea, the dream that my son will become a doctor and my daughter a nurse, is one step closer.\r\n                                                        </blockquote>\r\n                                                        <p>Nirus story does not end there however! Demand for the candles is such that Niru has been able to form a candle-making cooperative and three other women from the village have joined Niru in the business.</p>\r\n\r\n   \r\n                                                        <p>Be The Change intervention enabled Niru to support her family and create a flourishing enterprise. But it is Nirus hard work, dedication and generosity of spirit, which have made it possible to empower three additional families, all of whom have a bright future ahead.</p>\r\n                                                        <h4>ECONOMIC EMPOWERMENT</h4>\r\n                                                        <ul>Prior to Be The Change intervention, manual work was sporadic and Niru and her husband were earning a maximum of <strong>US$40 </strong> per month.<li>Providing Niru with the opportunity to realise her business idea (equipment, materials and stock) cost just: <strong> US$114</strong></li>\r\n                                                            <li>Niru makes 900 candles per month, generating <strong> US$40 </strong> profit..</li>\r\n                                                            <li>Niru has created a candle-making cooperative, empowering three additional families.</li>\r\n                                                        </ul>', 2, 'nirukumaribisunke-news-resources57', '', 0, NULL, NULL, 'nirukumaribisunke-news-resources50', 'Niru Kumasi Bisunke', 'Niru Kumari Bisunke', NULL, '2017-11-14 13:53:00', '2017-12-08 16:49:13');
