(7, 'On the Front Line of Typhoon Hagupit, Philippines', 'Jesse Mulligan', '2014-12-09', NULL, '<span style=\"color: rgb(64, 68, 65); font-family: Colfax, Arial, sans-serif; font-size: 16px;\">Front line humanitarian, Linda Cruse, speaks from the front line of relief efforts in the Philippines, where Typhoon Hagupit has forced the evacuation of hundreds of thousands of people from coastal areas.&nbsp;</span>', 0, 'onthefrontlineoftyphoonhagupit2cphilippines-news-resources49', 'https://www.radionz.co.nz/audio/player?audio_id=20160409', 0, NULL, NULL, 'onthefrontlineoftyphoonhagupit2cphilippines-news-resources86', NULL, NULL, NULL, '2017-12-08 17:33:17', '2017-12-08 17:33:17'),
(8, 'Be The Change: Impact Report 2016', 'Linda Cruse', '2016-12-12', NULL, '<div>The impact of Be The Change so far has been tremendous - helping upwards of 1,000 families a year since Linda Cruse began working on the front line over 18 years ago. This report summarises some of the most recent work.</div>', 3, 'bethechange3aimpactreport2016-news-resources17', '', 0, NULL, '5a2fb76b76a1dBe The Change Impact Report 2016 Updated.pdf', 'bethechange3aimpactreport2016-news-resources1', NULL, NULL, NULL, '2017-12-08 17:49:07', '2017-12-12 18:03:11'),
(10, 'My Little Black Book Interview with Linda Cruse', 'Victoria Smith', '2015-09-15', NULL, '<p>Victoria Smith of My Little Black Book has just 10 minutes to capture Linda\'s life on the front line.</p><p><a href=\"http://mylittleblackbook.co.uk/work/coffee-break/linda-cruse-international-aid-humanitarian-worker\">http://mylittleblackbook.co.uk/work/coffee-break/linda-cruse-international-aid-humanitarian-worker</a><br></p>', 0, 'mylittleblackbookinterviewwithlindacruse-news-resources74', '', 0, NULL, NULL, 'mylittleblackbookinterviewwithlindacruse-news-resources31', NULL, NULL, NULL, '2017-12-09 15:39:59', '2017-12-09 15:39:59'),
(11, 'Interview with Race4Good Business Leaders: Charles Black and Dena Burton', 'Rita Ciolek Documentary Maker', '2017-12-01', NULL, '<p>An interview with Charles Black of Hilton & Hyland and Dena Burton, of The Burton Collection, reflecting on their Race4Good experience in March 2017.  Filmed by Rita Ciolek.</p><p><a href=\"https://www.youtube.com/watch?v=ZG9PGBaePt8\">https://www.youtube.com/watch?v=ZG9PGBaePt8</a><br></p>', 0, 'interviewwithrace4goodbusinessleaders3acharlesblackanddenaburton-news-resources77', '', 0, NULL, NULL, 'interviewwithrace4goodbusinessleaders3acharlesblackanddenaburton-news-resources64', NULL, NULL, NULL, '2017-12-10 00:40:09', '2017-12-12 15:06:08'),
(12, 'Cuppa & Chat with Madeline Lewis for Virgin Unite', 'Madeleine Lewis', '2014-04-21', NULL, '<p>Madeline Lewis interviews Linda Cruse about her life on the front line as part of the Cuppa &amp; Chat series for Virgin Unite.&nbsp; &nbsp;</p><p><a href=\"https://www.virgin.com/virgin-unite/our-community/cuppa-chat-linda-cruse-humanitarian-magician\">https://www.virgin.com/virgin-unite/our-community/cuppa-chat-linda-cruse-humanitarian-magician</a><br></p>', 0, 'cuppa26chatwithmadelinelewisforvirginunite-news-resources53', '', 0, NULL, NULL, 'cuppa26chatwithmadelinelewisforvirginunite-news-resources23', NULL, NULL, NULL, '2017-12-10 20:48:03', '2017-12-10 20:48:03'),
(14, 'BBC Radio Saturday Live Breakfast Show Interview with Linda Cruse', 'Richard Coles', '2012-09-22', NULL, '<p class=\"MsoNormal\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Linda Cruse is interviewed on the popular\r\nSaturday morning BBC radio show - Saturday Live - and explains the\r\ncircumstances which triggered significant changes in her life.&nbsp; &nbsp;Interview by Richard Coles.</span><o:p></o:p></p>', 0, 'bbcradiosaturdaylivebreakfastshowinterviewwithlindacruse-news-resources18', 'http://www.bbc.co.uk/programmes/b01mtr34', 0, NULL, NULL, 'bbcradiosaturdaylivebreakfastshowinterviewwithlindacruse-news-resources84', NULL, NULL, NULL, '2018-01-18 16:20:39', '2018-01-18 16:20:39'),
(15, 'Corporate Social Responsibility or Corporate Social Opportunity', 'Linda Cruse', '2008-07-01', NULL, '<p class=\"MsoNormal\"><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">An ever-growing number of companies recognise the\r\nclear connection between the health and profitability of their business and the\r\nhealth and general well-being of the community in which they carry out their\r\ncommercial activities.&nbsp; &nbsp;Linda Cruse explores the benefits to\r\nbusiness of embracing Corporate Social Opportunity.<o:p></o:p></span></p>', 3, 'corporatesocialresponsibilityorcorporatesocialopportunity-news-resources85', '', 0, NULL, '5a60680081838Corporate Social Responsibility or Corporate Social Opportunity Linda Cruse 2008.pdf', 'corporatesocialresponsibilityorcorporatesocialopportunity-news-resources52', NULL, NULL, NULL, '2018-01-18 16:25:20', '2018-01-18 16:25:20'),
(16, 'The Volunteer - A Guide to Volunteering', 'Hugo Chittenden', '2015-01-01', NULL, 'Linda Cruse features in this book about volunteering, intended to inspire people of all ages to volunteer.&nbsp; &nbsp;The book draws on the expertise of influential volunteers who answer the fundamental questions to do with volunteering.&nbsp; &nbsp;Linda describes the events which led her to sell everything she owned and head for the front line.&nbsp; &nbsp; Link:&nbsp; http://bit.ly/GuidetoVolunteeringLC', 3, 'thevolunteer-aguidetovolunteering-news-resources57', '', 0, NULL, NULL, 'thevolunteer-aguidetovolunteering-news-resources54', NULL, NULL, NULL, '2018-01-29 16:01:52', '2018-01-29 16:01:52'),
(17, 'Race4Good Workshop: Vail, USA', 'Linda Cruse', '2018-02-08', '2018-02-08', '<span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">Linda Cruse will be running a mini Race4Good for the Vail community in USA in February - bringing together dynamic teams to tackle the issue of hunger affecting 17% of the local community. Link:</span><font color=\"#1d2129\" face=\"Helvetica, Arial, sans-serif\"><span style=\"font-size: 14px;\">https://www.eventora.com/en/Events/tedxvail-yes-2018</span></font>', 1, 'race4goodworkshop3avail2cusa-news-resources62', '', 0, NULL, NULL, 'race4goodworkshop3avail2cusa-news-resources56', NULL, NULL, NULL, '2018-01-29 16:07:51', '2018-01-29 16:35:51'),
(18, 'Keynote Speaker: Bristol International Development 2018', 'Linda Cruse', '2018-03-25', '2018-03-25', 'Linda Cruse is a keynote speaker at the annual Bristol International Development Conference in March 2018.  Now in its eighth year. The conference is a dynamic mix of workshops, discussions and debates by leading mind in international development from around the world. Link: http://www.bristolidc.org/', 1, 'keynotespeaker3abristolinternationaldevelopment2018-news-resources64', '', 0, NULL, NULL, 'keynotespeaker3abristolinternationaldevelopment2018-news-resources23', NULL, NULL, NULL, '2018-01-29 16:20:50', '2018-01-29 16:36:13'),
(19, 'Keynote Speaker: TED Talks, USA', 'Linda Cruse', '2018-02-10', '2018-02-10', 'Linda Cruse has been invited to record her second TED Talk in USA. Joining a distinguished list of previous speakers, Linda will talk about her life on the front line and her determination to tap into the skills and experience of the private sector to provide sustainable, business-led uplift for communities in need.  Link:https://www.ted.com/about/our-organization', 1, 'keynotespeaker3atedtalks2cusa-news-resources17', '', 0, NULL, NULL, 'keynotespeaker3atedtalks2cusa-news-resources46', NULL, NULL, NULL, '2018-01-29 16:34:59', '2018-01-29 16:41:07'),
(20, 'Be The Change: Redmaids School Students to Nepal', 'Linda Cruse', '2018-07-10', '2018-07-10', 'Linda Cruse, CEO, Be The Change will take a group of students from Redmaids School in the United Kingdom on an unforgettable front line experience in Nepal.&nbsp; &nbsp;Link:&nbsp;&nbsp;http://www.lindacruse.com/be-the-change.html', 1, 'bethechange3aredmaidsschoolstudentstonepal-news-resources31', '', 0, NULL, NULL, 'bethechange3aredmaidsschoolstudentstonepal-news-resources6', NULL, NULL, NULL, '2018-01-29 16:46:35', '2018-01-29 16:49:53'),
(21, 'Be The Change: Redmaids School Students to Morocco', 'Linda Cruse', '2018-10-27', '2018-10-27', 'Linda Cruse, CEO, Be The Change will take a group of students from Redmaids School in the United Kingdom on an unforgettable front line experience to Morocco.&nbsp; Link:&nbsp; http://www.lindacruse.com/be-the-change.html', 1, 'bethechange3aredmaidsschoolstudentstomorocco-news-resources65', '', 0, NULL, NULL, 'bethechange3aredmaidsschoolstudentstomorocco-news-resources32', NULL, NULL, NULL, '2018-01-29 16:49:18', '2018-01-29 16:49:18'),
(22, 'Be The Change: Business Leaders to Nepal', 'Linda Cruse', '2018-03-01', '2018-03-01', 'Linda Cruse, CEO,, Be The Change will lead a dynamic team of business leaders from all walks of life to a remote village in Nepal.&nbsp; &nbsp; Linda will draw on the skills and experience of the team to provide a business-led uplift to a village in need of help. Link:&nbsp;&nbsp;http://www.lindacruse.com/be-the-change.html', 1, 'bethechange3abusinessleaderstonepal-news-resources33', '', 0, NULL, NULL, 'bethechange3abusinessleaderstonepal-news-resources72', NULL, NULL, NULL, '2018-01-29 16:56:38', '2018-01-29 16:56:38'),
(23, 'Be The Change: Nepal', 'Linda Cruse', '2018-07-01', '2018-07-01', 'Linda Cruse, CEO, Be The Change will take a group of individuals from all walks of life on an unforgettable front line experience in Nepal where they will work together to uplift a community in need. Link:&nbsp;&nbsp;http://www.lindacruse.com/be-the-change.html', 1, 'bethechange3anepal-news-resources46', '', 0, NULL, NULL, 'bethechange3anepal-news-resources49', NULL, NULL, NULL, '2018-02-26 16:53:04', '2018-02-26 16:56:32'),
(24, 'Race4Good: Workshop Vail Colorado', 'Linda Cruse', '2018-03-06', NULL, 'Linda Cruse was invited by TEDxVail organisers to run a workshop based on the leadership programme: Race4Good. The challenge given to teams to address was: hunger in the eagle river valley.&nbsp; One challenge, three teams, four hours  but could it be done?&nbsp;<br>', 2, 'race4good3aworkshopvailcolorado-news-resources1', '', 0, NULL, '5a9e5e60471f4Race4Good Vail Case Study Feb 2018.pdf', 'race4good3aworkshopvailcolorado-news-resources2', NULL, NULL, NULL, '2018-03-06 16:24:48', '2018-03-06 16:24:48'),
(25, 'IBLF Taskforce: Best Intentions, Complex Realities', 'Linda Cruse - Co-Author', '2005-09-14', NULL, 'This paper was commissioned by the International Business Leaders Forum following the 2005 tsunami and explores how business goodwill and resources can effectively contribute to humanitarian relief and disaster recovery. These public/private sector collaborations form part of Linda Cruse\'s expertise.', 3, 'bestintentions2ccomplexrealities-news-resources71', '', 0, NULL, '5aa525179149cIBLF Taksforce - Best Intentions Complex Realities.pdf', 'iblftaskforce3abestintentions2ccomplexrealities-news-resources64', 'IBLF Taskforce: Best Intentions, Complex Realities', 'IBLF Taskforce: Best Intentions, Complex Realities', NULL, '2018-03-11 19:46:15', '2019-05-05 15:08:49'),
(26, 'Interview with Sky News Australia', 'Linda Cruse', '2018-05-16', NULL, '<p>An interview with Linda Cruse by Sky News Australia.&nbsp; &nbsp;Linda is in Australia speaking to dynamic companies about how employees can use their leadership and business skills to make a significant contribution on the frontline and in return experience something profound and long-lasting.&nbsp;&nbsp;<a href=\"https://www.facebook.com/SkyNewsAustralia/videos/10155496381576728/?fref=mentions\">Sky News Australia interview.</a></p>', 0, 'interviewwithskynewsaustralia-news-resources15', '', 0, NULL, NULL, 'interviewwithskynewsaustralia-news-resources19', NULL, NULL, NULL, '2018-05-16 18:32:41', '2018-05-16 18:32:41'),
(27, 'Keynote Speaker: International Symposium on Sustainable Systems and Technology, New York, USA', 'Linda Cruse', '2018-06-26', '2018-06-26', 'Linda Cruse will deliver the keynote speaker at the 25th International Symposium on Sustainable Systems and Technology, one of the longest-running research conferences related to sustainability and the intersection of technology, policy, and behaviour.  <a href=\"Link.https://issst2018.net/speakers/\">Link.</a>', 1, 'keynotespeaker3ainternationalsymposiumonsustainablesystemsandtechnology2cnewyork2cusa-news-resources53', '', 0, NULL, NULL, 'keynotespeaker3ainternationalsymposiumonsustainablesystemsandtechnology2cnewyork2cusa-news-resources41', NULL, NULL, NULL, '2018-05-28 14:13:12', '2018-05-28 20:37:38'),
(28, 'Linda Cruse: Race4Good', 'Linda Cruse', '2018-10-01', '2018-10-03', 'Linda Cruse, CEO, Race4Good will design and lead a R4G leadership programme in Hong Kong to help uplift a community affected by the Nepal earthquake.', 1, 'lindacruse3arace4good-news-resources27', '', 0, NULL, NULL, 'lindacruse3arace4good-news-resources83', NULL, NULL, NULL, '2018-06-05 23:55:09', '2018-06-05 23:55:09'),
(29, 'Linda Cruse: Be The Change', 'Linda Cruse', '2018-11-03', '2018-11-03', 'Linda Cruse, CEO, Be The Change will lead two exclusive Be The Change experiences to provide economic uplift for communities affected by recent hurricanes', 1, 'lindacruse3abethechange-news-resources8', '', 0, NULL, NULL, 'lindacruse3abethechange-news-resources5', NULL, NULL, NULL, '2018-06-05 23:57:11', '2018-06-05 23:57:11'),
(30, 'Podcast with Julie Masters, CEO of Influence Nation', 'Julie Masters', '2018-07-12', NULL, '<span style=\"font-size:11.0pt;font-family:\"Segoe UI\",sans-serif;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-GB;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">Julie Masters\r\ninterviews leading humanitarian and author, Linda Cruse. A call to arms\r\nto the private sector: Linda challenges businesses to apply the skills and\r\ninnovation present in the workforce, to create sustainable economic uplift for\r\ncommunities in need. Julie is the Founder and CEO of Influence\r\nNation, working with business leaders and organisations to become the voice of\r\nauthority in their space. </span>', 0, 'podcastwithjuliemasters2cceoofinfluencenation-news-resources53', 'http://juliemasters.com/stop-being-charitable-and-start-being-capable/', 0, NULL, NULL, 'podcastwithjuliemasters2cceoofinfluencenation-news-resources86', NULL, NULL, NULL, '2018-07-12 13:56:32', '2018-07-12 13:58:42'),
(32, 'Article by Margie Warrell, Forbes Columnist and Author', 'Margie Warrell', '2018-12-10', NULL, 'Margie Warrell explores the life-changing power of choosing service over status using Linda Cruses frontline career as the focus for her article.<br>', 0, 'articlebymargiewarrell2cforbescolumnistandauthor-news-resources76', 'http://bit.ly/ForbesDoingGoodVLookingGood', 0, NULL, NULL, 'articlebymargiewarrell2cforbescolumnistandauthor-news-resources44', NULL, NULL, NULL, '2018-12-13 18:38:39', '2019-05-11 19:52:51'),
(33, 'Linda Cruse: Race4Good for International Symposium on Sustainable Systems and Technology', 'Linda Cruse', '2019-06-26', '2019-06-25', '<span style=\"color: rgb(51, 51, 51); font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\">Linda Cruse will run a Race4Good for audience members and give a keynote speech at the 26th International Symposium on Sustainable Systems and Technology, one of the longest-running research conferences related to sustainability and the intersection of technology, policy, and behaviour.&nbsp; &nbsp;Portland, USA (25 - 27 June 2019).</span>', 1, 'lindacruse3arace4good-news-resources74', '', 0, NULL, NULL, 'lindacruse3arace4goodforinternationalsymposiumonsustainablesystemsandtechnology-news-resources80', NULL, NULL, NULL, '2019-02-02 22:16:45', '2019-02-02 22:43:42'),
(34, 'Linda Cruse: Race4Good Leadership Programme', 'Linda Cruse', '2019-06-03', '2019-06-03', 'Linda Cruse will run a full leadership programme wrapped around a Race4Good challenge for GSK, Hong Kong and participants from around the world.&nbsp; &nbsp;The aim to uplift a challenged and vulnerable community overseas.', 1, 'lindacruse3arace4goodleadershipprogramme-news-resources51', '', 0, NULL, NULL, 'lindacruse3arace4goodleadershipprogramme-news-resources69', NULL, NULL, NULL, '2019-02-02 22:27:35', '2019-02-02 22:45:44'),
(36, 'Race4Good: British Virgin Islands Youth Enrichment', 'Linda Cruse', '2018-11-09', '2018-11-09', 'Linda Cruse will run a Race4Good for Virgin Limited Edition guests. Teams will comprise of Necker Island guests, key members of the local community, youth from Virgin Gorda and Sir Richard Branson. The challenge to uplift the youth of Virgin Gorda following the devastation wreaked by Hurricane Irma.&nbsp;', 1, 'race4good3abritishvirginislandsyouthenrichment-news-resources47', '', 0, NULL, NULL, 'race4good3abritishvirginislandsyouthenrichment-news-resources82', NULL, NULL, NULL, '2019-02-02 22:51:31', '2019-02-02 22:58:47'),
(37, 'Be The Change: Redmaids School Students to Morocco', 'Linda Cruse', '2019-10-27', '2019-10-27', 'Linda Cruse, CEO, Be The Change will take a group of students from Redmaids School in the United Kingdom on an unforgettable frontline experience to Morocco.&nbsp; The trip is part of Linda\'s International Schools Programme, now in its second year.', 1, 'bethechange3aredmaidsschoolstudentstomorocco-news-resources17', '', 0, NULL, NULL, 'bethechange3aredmaidsschoolstudentstomorocco-news-resources37', NULL, NULL, NULL, '2019-02-02 23:02:24', '2019-02-03 18:10:26'),
(38, 'Race4Good: University of Technology Sydney', 'Linda Cruse', '2018-10-19', '2018-10-19', 'Linda Cruse will run a mini-Race4Good challenge for students from UTS.&nbsp; &nbsp;The aim to find an innovative way to uplift a challenged and vulnerable family in Nepal in just 4 hours.', 1, 'race4good3auniversityoftechnologysydney-news-resources20', '', 0, NULL, NULL, 'race4good3auniversityoftechnologysydney-news-resources100', NULL, NULL, NULL, '2019-02-03 17:28:42', '2019-02-03 17:28:42'),
(40, 'Linda Cruse: Courageous Leadership Workshop', 'Linda Cruse', '2019-07-01', '2019-07-01', 'Linda Cruse will run a two-day leadership workshop for GSK Taiwan based on her Courageous Leadership programme.', 1, 'lindacruse3acourageousleadershipworkshop-news-resources65', '', 0, NULL, NULL, 'lindacruse3acourageousleadershipworkshop-news-resources100', NULL, NULL, NULL, '2019-03-07 15:37:00', '2019-04-23 17:33:22'),
(41, 'Leading on the Frontline', 'Linda Cruse', '2019-02-03', NULL, 'Leading on the Frontline brings humanitarian leadership into the boardroom, giving business leaders a powerful lesson in engagement, motivation, inspiration and innovation. Drawing upon a lifetime of humanitarian work in some of the worlds most difficult places, author Linda Cruse shares stories from the frontline that illustrate how to dig deep, inspire, thrive and more.  Amazon: http://bit.ly/LindaCruse', 3, 'leadingonthefrontline-news-resources25', '', 0, NULL, NULL, 'leadingonthefrontline-news-resources3', 'Leading on the Frontline', 'Leading on the Frontline', NULL, '2019-03-18 22:14:13', '2019-03-19 11:07:15'),
(42, 'Keynote Speaker: Rabobank Australia and New Zealand', 'Linda Cruse', '2019-03-27', '2019-03-28', 'Linda Cruse will give a keynote speech at Rabobanks Farm2Fork summit in Australia where she will be joined by leading producers and industry trailblazers from around the globe to explore thought-provoking ideas and innovative solutions essential for the vitality and sustainability of the food and agri sector.&nbsp; <a href=\"https://www.rabobank.com.au/farm2fork/\">https://www.rabobank.com.au/farm2fork/</a>', 1, 'keynotespeaker3arabobankaustraliaandnewzealand-news-resources73', '', 0, NULL, NULL, 'keynotespeaker3arabobankaustraliaandnewzealand-news-resources52', NULL, NULL, NULL, '2019-03-27 16:48:28', '2019-03-27 16:48:28'),
(44, 'Be The Change: Nepal', 'Linda Cruse', '2019-09-09', NULL, 'Linda Cruse, CEO, Be The Change will take a dynamic group of individuals on an unforgettable frontline experience to Nepal.&nbsp; &nbsp;The image was taken by professional photographer, Tomas Cohen.&nbsp; Link:&nbsp;&nbsp;<span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-GB;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\"><a href=\"https://mailchi.mp/605389963cf3/linda-cruse-be-extraordinary-nepal\">https://mailchi.mp/605389963cf3/linda-cruse-be-extraordinary-nepal</a></span>', 1, 'bethechange3anepal-news-resources74', '', 0, NULL, NULL, 'bethechange3anepal-news-resources81', NULL, NULL, NULL, '2019-04-23 17:24:01', '2019-04-23 17:24:01'),
(45, 'Linda Cruse: Courageous Leadership Programme', 'Linda Cruse', '2019-09-02', '2019-09-02', 'Linda Cruse will run a two-month intensive leadership programme for GSK Japan, based on her Courageous Leadership programme and including a mini-Race4Good.', 1, 'courageousleadershipprogramme-news-resources15', '', 0, NULL, NULL, 'lindacruse3acourageousleadershipprogramme-news-resources88', NULL, NULL, NULL, '2019-04-23 17:32:19', '2019-04-23 17:34:09'),
(46, 'Keynote Speaker: Business in the Community Northern Ireland', 'Linda Cruse', '2019-05-30', '2019-05-30', 'Linda Cruse will give the keynote speech at a dinner hosted by Business in the Community Northern Ireland. Now in its 13th year, the annual awards recognise and celebrate the best of corporate responsibility in Northern Ireland.  Link:<a href=\"https://www.bitcni.org.uk/\">https://www.bitcni.org.uk/</a>', 1, 'keynotespeaker3abusinessinthecommunitynorthernireland-news-resources84', '', 0, NULL, NULL, 'keynotespeaker3abusinessinthecommunitynorthernireland-news-resources91', NULL, NULL, NULL, '2019-05-11 18:08:52', '2019-05-11 19:38:20'),
(47, 'Interview with Alex Boylan, Co-Founder of DreamJobbing', 'Linda Cruse', '2019-05-23', NULL, 'Linda explains how she developed Race4Good to engage the best and brightest minds in business and universities to tackle critical issues facing communities around the world.&nbsp; &nbsp; Link:&nbsp;<span style=\"font-size:11.0pt;font-family:\" calibri\",sans-serif;=\"\" mso-fareast-font-family:calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:=\"\" en-gb;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\"><a href=\"https://www.dreamjobbing.com/djtv/channel/5questionswith/episode/5QuestionsWithLindaCruse\">https://www.dreamjobbing.com/djtv/channel/5questionswith/episode/5QuestionsWithLindaCruse</a></span>', 0, 'interviewwithalexboylan2cco-founderofdreamjobbing-news-resources96', '', 0, NULL, NULL, 'interviewwithalexboylan2cco-founderofdreamjobbing-news-resources9', NULL, NULL, NULL, '2019-05-23 18:00:50', '2019-05-23 18:02:02');
