', 'Race 4 good is a race game design for student and corporate', 'Race for Good', '<p>Bringing together teams who are given just 21 days to research and develop a business plan which will bring long-term economic and social uplift to a challenged community.   \r\n                    </p>', 'raceforgood-setting74', 'Race For Good', 'https://www.therace4good.com/', 'https://www.youtube.com/channel/UCkIVsfjgWimca6vjpGHAG3A/videos', NULL, NULL, NULL, NULL, '2017-11-12 03:32:14', '2018-01-29 17:54:27');
INSERT INTO `stones` (`id`, `title`, `sub_title`, `image`, `link`, `url`, `editorDescription`, `participantDescription`, `meta_title`, `meta_description`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'The Race', 'Where the Best and Brightest Compete', 'The Race', '', '', '<p data-original-title=\"\" title=\"\">Linda Cruse brings together teams from around the world to take part in a unique competition  the Race4Good. The Race4Good invites the brightest and best brains from business and universities and forms them into dynamic teams to harness their experience, innovation, and passion.</p>\r\n                        <p data-original-title=\"\" title=\"\">Teams are given up to 21 days in which to research real-life challenges facing a specific community and to develop a business plan to bring long-term economic and social uplift. The winning team will be flown out to meet the community and see the first phase of their plan brought to life.</p>', '<div class=\"section-title\" data-original-title=\"\" title=\"\">\r\n                <h2 data-original-title=\"\" title=\"\">Benefits for participants</h2>\r\n            </div>\r\n            <div class=\"row\" data-original-title=\"\" title=\"\">\r\n                <div class=\"col-md-4 col-sm-12 col-xs-12\" data-original-title=\"\" title=\"\">\r\n                    <div class=\"benefit\" data-original-title=\"\" title=\"\">\r\n                        <h3 class=\"block-title\" data-original-title=\"\" title=\"\">The Business/University</h3>\r\n                        <ul class=\"list\" data-original-title=\"\" title=\"\">\r\n                            <li data-original-title=\"\" title=\"\"> Increases productivity through the feel good factor.</li>\r\n                            <li data-original-title=\"\" title=\"\">Offers real-life problem solving to unleash creativity and innovation.</li>\r\n                            <li data-original-title=\"\" title=\"\">Provides the ultimate fast- track skills upgrade.</li>\r\n                            <li data-original-title=\"\" title=\"\">Enhances company image and reinforces brand loyalty.</li>\r\n                            <li data-original-title=\"\" title=\"\">Provides deeper understanding of global cultures.</li>\r\n                            <li data-original-title=\"\" title=\"\">Improves employee engagement and team building.</li>\r\n                            <li data-original-title=\"\" title=\"\">Provides strong links with a third world community.</li>\r\n                            <li data-original-title=\"\" title=\"\">Enables companies to leave a long-term and meaningful legacy.</li>\r\n                            <li data-original-title=\"\" title=\"\">Provides CSR engagement and data.</li>\r\n                        </ul>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-md-4 col-sm-12 col-xs-12\" data-original-title=\"\" title=\"\">\r\n                    <div class=\"benefit\" data-original-title=\"\" title=\"\">\r\n                        <h3 class=\"block-title\" data-original-title=\"\" title=\"\">\r\n                            The Employee/Student\r\n                        </h3>\r\n                        <ul class=\"list\" data-original-title=\"\" title=\"\">\r\n                            <li data-original-title=\"\" title=\"\"> Provides a unique challenge which improves morale.</li>\r\n                            <li data-original-title=\"\" title=\"\"> Increases productivity.</li>\r\n                            <li data-original-title=\"\" title=\"\"> Provides the ultimate skills upgrade.</li>\r\n                            <li data-original-title=\"\" title=\"\"> Builds better team working.</li>\r\n                            <li data-original-title=\"\" title=\"\"> Improves leadership and cross-cultural communication.</li>\r\n                            <li data-original-title=\"\" title=\"\"> Boosts confidence in capabilities and strengthens CV.</li>\r\n                            <li data-original-title=\"\" title=\"\"> Provides a deeper understanding of global cultures and forges long-term links with a\r\n                                community.\r\n                            </li>\r\n                            <li data-original-title=\"\" title=\"\"> Provides a unique opportunity to join Linda Cruse on the frontline.</li>\r\n\r\n                        </ul>\r\n                    </div>\r\n                </div>\r\n                <div class=\"col-md-4 col-sm-12 col-xs-12\" data-original-title=\"\" title=\"\">\r\n                    <div class=\"benefit\" data-original-title=\"\" title=\"\">\r\n                        <h3 class=\"block-title\" data-original-title=\"\" title=\"\">\r\n                            The Community\r\n                        </h3>\r\n                        <ul class=\"list\" data-original-title=\"\" title=\"\">\r\n                            <li data-original-title=\"\" title=\"\"> Solves seemingly intractable problems through practical solutions.</li>\r\n                            <li data-original-title=\"\" title=\"\"> Provides hope to a stricken community in the form of economic, social and environmental\r\n                                transformation.\r\n                            </li>\r\n                            <li data-original-title=\"\" title=\"\"> Gives the community access to invaluable business acumen.</li>\r\n                            <li data-original-title=\"\" title=\"\"> Enables the villagers to learn new skills and competences.</li>\r\n                            <li data-original-title=\"\" title=\"\"> Long-term links with employees/students.</li>\r\n                            <li data-original-title=\"\" title=\"\"> Transforms lives.</li>\r\n\r\n                        </ul>\r\n                    </div>\r\n                </div>\r\n            </div>', '', '', NULL, '2017-11-12 03:32:14', '2018-02-11 21:16:06'),
(2, 'Join The Race', '', 'Join The Race', '', '', '<p data-original-title=\"\" title=\"\"> Could you be part of a team even more dynamic, passionate and creative than we\r\n                                have seen before? Could your team produce the most innovative and effective\r\n                                business plan yet?\r\n                            </p>\r\n                            \r\n                              <p data-original-title=\"\" title=\"\">  Previous winning ideas include:\r\n                                 </p><ul data-original-title=\"\" title=\"\">\r\n\r\n                                     <li data-original-title=\"\" title=\"\">Bee-keeping, producing honey for an ever growing ayurvedic market.</li>\r\n                                     <li data-original-title=\"\" title=\"\">Bamboo growing which ensures extra nutrition, stops landslides and is great for \r\n                                      building earthquake-proof homes.    \r\n                                    </li>\r\n                                     <li data-original-title=\"\" title=\"\">Planting high cash crop fruit such as apples.</li>\r\n                                 </ul>\r\n                                <p data-original-title=\"\" title=\"\"></p>\r\n                            \r\n                            <p data-original-title=\"\" title=\"\">\r\n                                \r\n                                How will you transform a community?\r\n                                Whether an employee, business leader, student or university alumni - we would love to talk to you about how you can get involved in the Race4Good.   For information about race dates, costs, terms and conditions, registration, the race calendar and how the race can be tailored to your needs, complete a contact us enquiry. \r\n\r\n                                \r\n\r\n                            </p>\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                For general information about how teams are selected, eligibility, how to register, time commitment guidelines, how teams are selected and different roles within a team, see the full Terms and Conditions in\r\n                                 <a href=\"http://therace4good.com/Race-Steps/Race-Rules\">RACE RULES</a>.\r\n                            </p>', '<p><br></p>', '', '', NULL, '2017-11-12 03:32:14', '2017-11-21 18:33:03'),
(3, 'Meet The Teams', '', 'Meet The Teams', '', '', '<p> In general, there may be up to six teams competing in a university competition with\r\n                            teams comprising 4  6 students and 3  5 business leaders or alumni. In the case of a\r\n                            business-led competition, teams can be of any size.</p>\r\n                            <p>\r\n                                The competition can be tailored to meet the specific needs of a business or university  whether that means smaller teams, a longer competition or a bigger business plan budget.  \r\n                            </p>', '<div class=\"section-title\">\r\n                <h2>Some examples of team compilations</h2>\r\n            </div>\r\n            <div class=\"row\">\r\n               \r\n                <div class=\"col-md-6 col-sm-12 col-xs-12\">\r\n                    <div class=\"benefit\">\r\n                        <h3 class=\"block-title\">\r\n                            Businesses\r\n                        </h3>\r\n                        <ul class=\"list\">\r\n                            <li>Employees within a business form teams and compete against each other.</li>\r\n                            <li>\r\n                                 A team is created by taking individuals from across regions, for example Asia Pacific, a team member would be selected from Taiwan, Australia, Pakistan, India, Hong Kong, Singapore.   Any number of teams, with a similar format to this, would be created and compete against each other.  \r\n                            </li>\r\n                            <li>A business forms a team and competes against other businesses.</li>\r\n\r\n                        </ul>\r\n                    </div>\r\n                </div>\r\n                 <div class=\"col-md-6 col-sm-12 col-xs-12\">\r\n                    <div class=\"benefit\">\r\n                        <h3 class=\"block-title\">\r\n                            Universities:\r\n                        </h3>\r\n                        <ul class=\"list\">\r\n                            <li> Students from different faculties form a team, supported by university alumni and\r\n                                compete\r\n                                against other teams within the university.\r\n                            </li>\r\n                            <li> Students from different faculties form a team, supported by local Business Leaders\r\n                                and compete against other teams within the university.\r\n                            </li>\r\n                            <li> Students/alumni from the same university form a team and compete against other\r\n                                universities.\r\n                            </li>\r\n                            <li> Students from the same university form a team, supported by local Business Leaders\r\n                                and compete against other universities.\r\n                            </li>\r\n                        </ul>\r\n                    </div>\r\n                </div>\r\n\r\n            </div>', '', '', NULL, '2017-11-12 03:32:14', '2017-11-13 11:30:19'),
(4, 'Race Rules', '', 'Race Rules', '', '', '<p data-original-title=\"\" title=\"\"> We try to impose as few rules as possible as we know teams will want to win based on their own hard work, passion, creativity, ingenuity and determination to succeed.  A few rules are essential however and these can be found in the Terms and Conditions below.    </p>\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                Teams will communicate throughout via Team Basecamp which is an online project management space which we will use to communicate with teams and coordinate the Race4Good.    We will create a private project space specifically for your team; other teams in the competition do not have access to your space.     It is a central place for the team to send messages, keep up to date, schedule tasks and events and upload documents.  Invitations to Team Basecamp will be sent once the competition has launched.  You can find rules about Basecamp below.\r\n                            </p>\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                Teams cannot confer, collaborate or share information with other teams taking part in any R4G competition running at the same time.\r\n                            </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-19 14:22:22'),
(5, 'The Support Crew', '', 'The Support Crew', '', '', '<p data-original-title=\"\" title=\"\"> From Day 1, when teams learn which community they have been allocated, the clock begins to tick down to the final day of the competition.  During the Race, teams are supported by the Support Crew comprising of the Race4Good operations team, Advisory Group members, a local guide and other key individuals.   The operations team will be available via Basecamp and Skype.     </p>\r\n                        <p data-original-title=\"\" title=\"\">The following are guidelines only, you will find specific rules in Team Basecamp once the competition has launched:</p>\r\n                        <p data-original-title=\"\" title=\"\">Advisory Group:   We pull together six experts in their field which may include: social entrepreneurship, education, financial services, religion, engineering.  </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            Local Guide:   The local guide will relay your questions to the community and give you the communitys feedback using a template provided.    Details about how teams can engage with the Local Guide, the timetable for questions, and information about individual community members, can be found in Team Basecamp.\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            You will find details of all your key contacts and the support available in Team Basecamp at the competition launch.\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            See <a href=\"http://therace4good.com/Race-Steps/Ask-Questions\"> ASK QUESTIONS</a> for more details.\r\n                        </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-21 16:57:54'),
(6, 'Race Start:DAY 1', '', 'Race Start:DAY 1', '', '', '<p>\r\n                          The day has finally arrived!   This can be a virtual or face to face event.  It is themed to launch you into the race environment and the culture in which you will be immersed for the next three weeks.\r\n                    </p>\r\n                  <p>\r\n                      If teams have not already been formed, this is where it happens.  A fast, timed, ice-breaker game brings teams together for the first time.   The team that comes together first receives a bonus question they can ask the community during the race.\r\n                  </p>\r\n                    <p>\r\n                        At the end of the launch event, a big clock will count down the minutes to the official race launch.  Tick, tock\r\n\r\n                    </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-12 16:42:22'),
(7, 'Road To Success', '', 'Road To Success', '', '', '<p>\r\n                        As part of the process of producing a viable business plan you will touch on the following stones several times during the competition:\r\n                    </p>\r\n                        <ul>\r\n                            <li>Research and Brainstorm</li>\r\n                            <li> Face the Challenges</li>\r\n                            <li>Ask Questions\r\n                            </li>\r\n                            <li>Get Feedback</li>\r\n                            <li>Identify Issues</li>\r\n                            <li>\r\n                                Review and Refine\r\n                            </li>\r\n                        </ul>\r\n                        <p>.until you are ready to finalise your business plan and submit it for judging.</p>\r\n                        <p>Have your team set your own fundraising goal  if so you may wish to kick start a social media campaign.\r\n                            You will find photographs, videos and case studies of previous competitions in your Team Toolbox folder in Basecamp  feel free to use these images during the competition.\r\n                        </p>', '<div class=\"section-title\">\r\n                    <h2>The key factors to success include </h2>\r\n                </div>\r\n\r\n            <ul class=\"list text-left\">\r\n\r\n                <li>Wearing the moccasins of the community as deeply as possible. &nbsp;&nbsp;&nbsp;&nbsp;Imagine yourself as a villager  the daily life, limitations, struggles, joys.</li>\r\n                <li>Having an inquisitive mind, not being satisfied with the first answer. </li>\r\n                <li>Constantly digging deeper, looking at all of the variables. </li>\r\n                <li>Checking the possible solution with fixed benchmarks, such as the environment, the taboos of the culture, the religion. </li>\r\n                <li>Careful questioning, careful listening.</li>\r\n                <li>Dont assume anything.&nbsp;&nbsp;&nbsp;&nbsp; Look at all of your ideas and check none is based on a learned response.</li>\r\n                <li>Learn from everyone.&nbsp;&nbsp;&nbsp;&nbsp;Ask as many people as you can for their ideas, advice, opinion. We provide a certain resource  but you are not limited to that.  </li>\r\n                <li>What is your instinct telling you?</li>\r\n                <li>The winning team will prove the financial viability, the sustainable uplift, but the winner will likely have done all of that and come up with something that blows the judges away  a jewel of an idea that you discovered.</li>\r\n            </ul>', '', '', NULL, '2017-11-12 03:32:14', '2017-11-13 11:39:59'),
(8, 'Base Camp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-12 03:32:14', '2017-11-12 03:32:14'),
(9, 'Research And Brainstorm', '', 'Research And Brainstrom', '', '', '<p data-original-title=\"\" title=\"\">Getting together as a team, you will begin by reviewing the information you have received about the country and about the specific community you are going to help.    You may wish to allocate specific roles to team members such as: identifying and approaching experts; research lead, business plan presentation lead; social media lead etc.  Or you may decide each team member will be involved in all aspects of the plan.</p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            If you are a university team and have business leaders supporting you, the business leaders may wish to support their team in a particular way based on their skills and areas of expertise, for example: development coach; business plan coach, entrepreneurial/market opportunities coach.\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">Copying a previous idea is unlikely to set the judges hearts on fire.  We are not expecting you to come up with an idea that has never been tried before in the world, but we are expecting you to produce something unique and inspirational and importantly is your own work.\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            Further details about roles within teams can be found in the Terms and Conditions in <a href=\"http://therace4good.com/Race-Steps/Race-Rules\" data-original-title=\"\" title=\"\">RACE RULES</a>.\r\n                        </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-12-03 13:54:24'),
(10, 'Review And Refine', '', 'Review And Refine', '', '', '<p data-original-title=\"\" title=\"\">\r\n                            Having agreed on the issues you wish to tackle as a team, you are beginning to address these in more detail, repeating the previous steps of Research and Brainstorming, Ask Questions etc.    Your questions will now be more specific and you should not be afraid to ask your experts if your potential solutions are viable  if they are not, or need adjusting, there is still time at this point. Review the guidelines on Business Plan formats which can be found in <a href=\"http://therace4good.com/Race-Steps/Finalize-The-Plan\">FINALISE THE PLAN</a>.\r\n                        </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-21 16:59:10'),
(11, 'Identify Issues', '', 'Identify Issues', '', '', '<p>\r\n                            As a result of your research, reaching out to experts and receiving feedback, you are beginning to identify a number of real issues facing the community.   When you are confident that you understand the issues, you will agree as a team which issues you wish to explore further.     The final business plan should tackle between one to four issues in total.\r\n                        </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-17 21:06:25'),
(12, 'Get Feedback', '', 'Get Feedback', '', '', '<p>\r\n                            You are beginning to get feedback from experts you have sought out, or have received feedback from the advisory group members or from the community itself via the local guide.     You will aim to get a number of opinions and responses to the same question and will carefully consider that feedback.   Use the feedback to help you begin to identify the main issues affecting the community.\r\n                        </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-13 11:46:53'),
(13, 'Ask Questions', '', 'Ask Questions', '', '', '<p data-original-title=\"\" title=\"\">\r\n                           \r\n                            In standard competitions, teams are allocated a maximum of six Advisory Group questions in total, unless they win additional questions through a mid-race Challenge.    It is up to teams to decide which advisory group member to approach with a specific question and when to ask that question.  You will find details of the Advisory Group members, their area of expertise and how to contact them in Team Basecamp, together with a question template.   The template must be completed and posted to Team Basecamp so operations can monitor how many questions have been asked. \r\n                            </p>\r\n                            <p data-original-title=\"\" title=\"\">\r\n                            Team are allocated a specific number of questions they can ask the community via the local guide, unless they win additional questions through a mid-Race Challenge.    It is up to teams to decide what questions to ask.     There are usually three rounds of questions, with the final round of questions being by the local guide during a Skype call.  You will find details of the community, the local guide and how to contact them in Team Basecamp.\r\n                            </p><p data-original-title=\"\" title=\"\">\r\n                            Remember as part of your research  you are strongly encouraged to identify other experts who may be able to offer you specific advice and who are willing to share their experience.   You can find suggestions about approaching experts in Terms and Conditions in <a href=\"http://therace4good.com/Race-Steps/Race-Rules\"> RACE RULES</a>.  If you rely only on the local guide and the advisory group, your progress may be delayed and you are less likely to have the winning plan.\r\n\r\n                        </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-21 16:55:51'),
(14, 'Face The Challenges', '', 'Face The Challenges', '', '', '<p data-original-title=\"\" title=\"\">\r\n                            To help you understand the types of challenges facing your community, we will set one or two Mid-Race Challenges during the competition.\r\n                            These will take the form of a real and current problem affecting the lives of some or all of the community and we will give you a short space of time in which to suggest a solution to that challenge.\r\n                            One will be chosen as the winning solution and will be implemented without delay.   The winning team will be awarded additional questions to put to the local guide or advisory group.</p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-12-03 14:30:28'),
(15, 'Finalise The Plan', '', 'Finalise The Plan', '', '', '<p data-original-title=\"\" title=\"\">\r\n                            Below you will find rules about the acceptable format of the Business Plan and PowerPoint presentation.    Plans and presentations which do not meet the rules may be rejected (for example 21 pages in length, rather than 20).\r\n\r\n                            You will be given a specific date and time by which your business plan must be submitted to Team Basecamp.    Remember to alert the operations team when your plan is posted.  Once all have been submitted, teams will be able to read each others plans.\r\n                         </p>\r\n                         <p data-original-title=\"\" title=\"\">\r\n                              You will be given a few more days to finalise your PowerPoint presentation, which must be submitted by a specific date and time.\r\n\r\n                            Depending on whether there is a formal closing event, you may also be asked to design a team poster.  You can find poster guidelines below.\r\n                         </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-13 17:22:50'),
(16, 'Finish Line:Day 21', '', 'Finish Line:Day 21', '', '', '<p>You are heading towards the finish line, one last push.  You can work up to the final minute of Day 21.  Just ensure you submit before the clock strikes midnight. \r\n                         </p>\r\n                         <p>\r\n                              As a team, take a moment to celebrate your achievement.  We are excited and waiting to receive your great work.\r\n                         </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-12 16:44:27'),
(17, 'Judging', '', 'Judging', '', '', '<p data-original-title=\"\" title=\"\">\r\n                            The arrangements for judging may vary from competition to competition.  Generally, judging takes place on the same day, all teams are present in the same room at the same time and each team presents their plan in turn to a panel of carefully selected judges.\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            The judges will have received the PDF business plan and the PPT presentation in advance.    The judges will also have received judging criteria to guide them (example below).    The judging chair will have received the communitys feedback and scores, which they will share with the judges on the day.\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            \r\n                        \r\n                            The teams have 10 minutes to present their plan using the previously submitted PPT presentation.    The teams then have 10 minutes in which to answer the judges questions.      There may be a short break in between presentations.\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            \r\n                        \r\n                            We encourage as many team members to be as present as possible, including business leaders, where appropriate.    For university teams, the presentation and Q&amp;As will be student led; business leaders are there in a supporting role.     We appreciate that students may have exam or study commitments which they cannot avoid, teams will not be penalised in these circumstances, but there must be a minimum of two students present.\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            Once the judges have heard all the presentations, they will retire to a private room to deliberate and agree on a winner.</p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-13 17:24:47'),
(18, 'Winner\'s Podium', '', 'Winner\'s Podium', '', '', '<p>\r\n                            The winning team will be announced at the closing event.   Guests will hear about the plans and learn more about the teams and towards the end of the event the overall winning team will be announced.    The date and time of the closing event will be confirmed once the competition has launched and details will be posted in Team Basecamp.\r\n                        </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-13 11:42:39'),
(19, 'Meet The Community', '', 'Meet The Community', '', '', '<p>\r\n                            You did it!  Your team has produced an amazing, innovative and unique winning plan and the reward for all your hard work is to fly out to meet the community.   They are going to be delighted to meet you and your team members in person and excited to work with you to implement the plan.     Expect tears of joy!\r\n\r\n                        </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-13 11:43:24'),
(20, 'Implement The Plan', '', 'Implement The Plan', '', '', '<p>\r\n                            During your short time with the community, Linda Cruse, the local team and the community will help you make any final adjustments to the plan and will begin to implement the first phase.        You will fly back home after a few days knowing that your hard work is going to have a wonderful and long-term impact on people in the community.    Expect a warm glow!\r\n\r\n\r\n                        </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2017-11-13 11:44:03'),
(21, 'Stay Connected', '', 'Stay Connected', '', '', '<p data-original-title=\"\" title=\"\">\r\n                            The Frontline Club  if you have taken part in the Race4Good in any way you are automatically a member. You will receive regular updates on families impacted by Race4Good  interventions and have priority notice of future front line experiences.\r\n                        </p>\r\n                           \r\n                        <p data-original-title=\"\" title=\"\"> The Frontline Club will host regular reunions, where the coolest conversations and networking will happen, with world class guest speakers.\r\n\r\n                        </p>', NULL, '', '', NULL, '2017-11-12 03:32:14', '2018-02-11 21:30:43'),
(22, 'Linda Cruse', 'Described as one-part pioneer, one-part entrepreneur and one-part magician, Linda Cruse is the ultimate frontline humanitarian and leadership expert, intent on changing the world forever.', 'Linda Cruse', '', '', '<p data-original-title=\"\" title=\"\">\r\n                                Linda Cruse is an international aid worker, leadership expert, author,\r\n                                inspirational speaker and founder and CEO of Be The Change:\r\n                                Business Leaders at the Frontline, Race4Good and Emergency Zen thought-leadership\r\n                                series.&nbsp; More information and details of Linda\'s programmes can be found at: <a href=\"http://www.lindacruse.com\" data-original-title=\"\" title=\"\">www.lindacruse.com</a></p>\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                Lindas 18+ years of frontline humanitarian aid work have taken her to every continent\r\n                                in the world where she has assisted in some of the most catastrophic natural disasters\r\n                                such as the Asian tsunami, the Pakistani earthquake, two Philippine super-typhoons and\r\n                                currently the aftermath of the 2015 Nepal earthquake. Her work has taken her to conflict\r\n                                zones, high mountain nomadic areas and refugee camps, as well as into challenged\r\n                                communities worldwide.\r\n                            </p>\r\n\r\n                            <p data-original-title=\"\" title=\"\">Linda Cruse is the\r\n                                ultimate humanitarian aid worker intent on changing the world forever.\r\n                            </p>\r\n\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                In 1996 Linda was a stressed-out mum working in a job she hated, was driving along a\r\n                                motorway in the UK in the middle of the night when she suffered temporary blindness.\r\n                                This terrifying episode led to a profound insight: what is the point of living if life\r\n                                has no point? Determined to make a difference, Linda started a new life as a frontline\r\n                                humanitarian aid worker.\r\n                            </p>\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                Linda has fused her passion for adventure and explorers spirit with a deep desire to\r\n                                make a difference to remote communities. To enable her to do this she has developed and\r\n                                launched two unique programmes:\r\n\r\n                            </p>\r\n                            <h4 data-original-title=\"\" title=\"\">\r\n                                Be the Change: Business Leaders at the Frontline\r\n                            </h4>\r\n                            <p data-original-title=\"\" title=\"\">\r\n\r\n                                To engage the best and brightest minds and apply their entrepreneurial skills,\r\n                                innovation,\r\n                                passion and creativity to sustainably uplift challenged communities.\r\n                            </p>\r\n\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                Linda used her extensive knowledge of private sector engagement to develop this unique\r\n                                programme for employees; enabling personal and professional development within an\r\n                                organisation whilst simultaneously bringing meaningful change to the world.\r\n\r\n                            </p>\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                Be The Change takes passionate, inspiring and creative leaders and uses their\r\n                                professional and personal skills to solve some of the worlds seemingly most intractable\r\n                                problems. Developed in 2010, the BTC programme is designed to make a real difference in\r\n                                communities where other initiatives have failed or never been attempted. Led by Linda\r\n                                Cruse, participants take on the role of a Be The Change ambassador and fly out to spend\r\n                                time with a carefully selected community in desperate need of help. As a team, the BTC\r\n                                ambassadors devise a business plan to economically and socially uplift a village using a\r\n                                hand up, business-led approach; exploring ways of injecting vibrancy, innovation and\r\n                                new market opportunities into the community.\r\n                            </p>\r\n                            <h4 data-original-title=\"\" title=\"\"> Race4Good: Where the Best and Brightest Compete</h4>\r\n                            <p data-original-title=\"\" title=\"\">\r\n\r\n                                To bring together teams from business and universities in a dynamic virtual game\r\n                                to solve real-life obstacles facing challenged communities.\r\n                                Further details of this unique programme can be found in <a href=\"http://therace4good.com/About-us/What-We-Do\" data-original-title=\"\" title=\"\">What  we do</a>.\r\n\r\n                            </p>\r\n                            <h4 data-original-title=\"\" title=\"\">Author and Inspirational Speaker</h4>\r\n                            <p data-original-title=\"\" title=\"\">\r\n\r\n                                Lindas book Marmalade and Machine Guns 16 countries, 3 continents, 12 years and one\r\n                                suitcase, one womans quest to help disaster-stricken communities back on their feet,\r\n                                follows her outstanding work and the adventures. Endorsed by Sir Richard Branson who\r\n                                comments; Linda makes the impossible, possible.\r\n\r\n                            </p>\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                Linda lectures and teaches worldwide. She is a compelling and inspirational speaker with\r\n                                a unique understanding of motivation, global cultures, leadership and community\r\n                                building.\r\n                            </p>\r\n\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                Linda has worked side by side with some of the worlds most influential figures\r\n                                including HH The Dalai Lama, HRH Prince Charles and Sir Richard Branson and companies\r\n                                including Nestle, Cadburys, Thai Beverage, KPMG, Manpower, Merrill Lynch, Deloitte, GSK,\r\n                                Continental Airlines, Wyeth, Abbott, Allied Dunbar and Hasbro. Linda has also worked\r\n                                alongside foundations such as The Prince of Wales International Business Leaders Forum,\r\n                                United Nations High Commission for Refugees, Virgin Unite, the World Bank and numerous\r\n                                local grass roots NGOs.\r\n                            </p>\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                In 2014, Linda was appointed a Senior Fellow in Residence in the College of Business and\r\n                                Law at the University of Canterbury New Zealand.\r\n                            </p>\r\n                            <p data-original-title=\"\" title=\"\">\r\n                                Linda is also a qualified nurse and magician!\r\n                            </p>\r\n\r\n                            <span class=\"trigger\" data-original-title=\"\" title=\"\">+ read more</span>', NULL, 'Linda Cruse', '', NULL, '2017-11-12 03:32:14', '2019-03-13 15:25:50'),
(23, 'Business Leaders', 'Could your employees be part of a Race4Good team even more dynamic, passionate and creative than we have seen before?', NULL, '', '', '<div class=\"desc padding-lr-100\" data-original-title=\"\" title=\"\">\r\n                                  <p class=\"MsoNormal\" data-original-title=\"\" title=\"\">Are you looking for a unique leadership programme which will\r\nset you apart from the competition and change the way you develop your workforce? Your employees wont just experience the\r\nRace4Good, they will experience a personal transformation.</p>\r\n                                  <h2 data-original-title=\"\" title=\"\">\r\n                                      What is R4G?\r\n                                  </h2>\r\n                                  <p class=\"MsoNormal\" data-original-title=\"\" title=\"\"><o:p data-original-title=\"\" title=\"\"></o:p></p><p data-original-title=\"\" title=\"\">The Race4Good combines Lindas frontline leadership skills with\r\na virtual reality game to form a high-impact leadership programme for business,\r\nthe Race4Good.&nbsp;&nbsp; Available as a comprehensive,\r\ndeep-immersion leadership programme or a stand-alone race; the Race4Good is a unique\r\nway to attract, develop and retain employees.&nbsp; </p><p class=\"MsoNormal\" data-original-title=\"\" title=\"\">Central to the programme is a dynamic, virtual race through\r\nwhich participants discover, develop and embed leadership skills by immersing\r\nthemselves in rich, real-life content.&nbsp;&nbsp;&nbsp;\r\nWorking within teams, participants benefit from high-impact experiential\r\nlearning, virtual reality, leadership lessons and situational leadership\r\nchallenges designed to drive\r\ncore values, encourage cross-cultural communication, spark innovation and celebrate outstanding performance.&nbsp;&nbsp; Its virtual gaming and leadership with a\r\nreal-world twist!&nbsp; &nbsp;&nbsp;</p><h2 data-original-title=\"\" title=\"\" style=\"color: rgb(0, 0, 0);\">Why R4G?</h2><p class=\"MsoNormal\" data-original-title=\"\" title=\"\">During the race, teams are challenged to develop an\r\ninnovative business plan to solve critical issues facing a specific\r\ncommunity across the globe.&nbsp; &nbsp;Within this healthy but pressurized\r\nenvironment, accelerated change takes place as passionate, inspiring and\r\ncourageous leaders race against each other for the opportunity to implement\r\ntheir plan.&nbsp; Inspired by gamification for learning, the race provides a safe space for trial and error in which participants can experiment and make decisions.&nbsp; &nbsp; Drawing on compelling,\r\nreal-life content, participants begin to share their experience through storytelling;\r\nstories which underpin brand, convey\r\npassion and purpose and bring business strategy to life.&nbsp; &nbsp; Throughout the race, teams are monitored and receive timely feedback intended to achieve optimal results, develop instincts and emotional responses, and promote effective and informed decisions.&nbsp; &nbsp; Tapping into human emotion, the race includes competition and reward and real-life content designed to boost understanding and retention.&nbsp; &nbsp; Simply put - gamification achieves results.</p>\r\n                                  <h2 data-original-title=\"\" title=\"\">Award</h2>\r\n                                  <p class=\"MsoNormal\" data-original-title=\"\" title=\"\"><o:p data-original-title=\"\" title=\"\"></o:p></p><p data-original-title=\"\" title=\"\">The winning team travel to the community to see the plan\r\nbrought to life and are rewarded with a life-changing experience which gives them a\r\nbigger view of the world and fresh insights to bring to the workplace.&nbsp;&nbsp;&nbsp; The benefits do not end there however.&nbsp; &nbsp;The\r\nrace fosters accountability and teamwork and demonstrates that when you pair\r\ninnovation with heart, the result is true and long-lasting transformation.</p><p data-original-title=\"\" title=\"\">T&amp;Cs apply.&nbsp; &nbsp; For details contact the team.&nbsp;</p><p data-original-title=\"\" title=\"\">If you would like to learn more and discuss the possibilities with Linda Cruse, <span data-original-title=\"\" title=\"\" style=\"\"><a href=\"http://therace4good.com/contact-us\" data-original-title=\"\" title=\"\"><font color=\"#636363\" data-original-title=\"\" title=\"\">CONTACT US</font></a></span>.<br data-original-title=\"\" title=\"\"></p>\r\n                                  <h5 data-original-title=\"\" title=\"\"><br data-original-title=\"\" title=\"\"></h5>\r\n\r\n                              </div>', '<div class=\"section-title\" data-original-title=\"\" title=\"\">\r\n                        <h2 data-original-title=\"\" title=\"\">Benefits for participants</h2>\r\n                    </div>\r\n                    <div class=\"row\" data-original-title=\"\" title=\"\">\r\n                        <div class=\"col-md-4 col-sm-12 col-xs-12\" data-original-title=\"\" title=\"\">\r\n                            <div class=\"benefit\" data-original-title=\"\" title=\"\">\r\n                                <h3 class=\"block-title\" data-original-title=\"\" title=\"\">\r\n                                    The Business\r\n                                </h3>\r\n                                <ul class=\"list\" data-original-title=\"\" title=\"\">\r\n                                    <li data-original-title=\"\" title=\"\">The power of gamification within a leadership programme.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Tailored to meet specific business needs and achieve optimal results.</li>\r\n                                    <li data-original-title=\"\" title=\"\">High-impact, accelerated situational learning and enhanced storytelling.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Unique way to attract, develop and retain employees.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Sparks drive, innovation and emotional engagement.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Drives core values and cross-cultural communication.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Celebrates outstanding performance.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Enhances company image and brand loyalty.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Provides CSR engagement and data.</li>\r\n                                </ul>\r\n                            </div>\r\n                        </div>\r\n                        <div class=\"col-md-4 col-sm-12 col-xs-12\" data-original-title=\"\" title=\"\">\r\n                            <div class=\"benefit\" data-original-title=\"\" title=\"\">\r\n                                <h3 class=\"block-title\" data-original-title=\"\" title=\"\">\r\n                                    The Employee\r\n                                </h3>\r\n                                <ul class=\"list\" data-original-title=\"\" title=\"\">\r\n                                    <li data-original-title=\"\" title=\"\">Engages and immerses participants in real-life content.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Strengthens accountability, teamwork and loyalty.<br data-original-title=\"\" title=\"\"></li>\r\n                                    <li data-original-title=\"\" title=\"\">Enhances cross-cultural communication.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Develops storytelling, resilience and courage.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Provides a safe space for trial and error.</li><li data-original-title=\"\" title=\"\">Includes monitoring and feedback for effective and informed decision-making.</li><li data-original-title=\"\" title=\"\">Boosts understanding and retention.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Brings fresh insights into the workplace.\r\n                                    </li>\r\n                                    <li data-original-title=\"\" title=\"\"> Provides a life-changing experience.</li>\r\n\r\n                                </ul>\r\n                            </div>\r\n                        </div>\r\n                        <div class=\"col-md-4 col-sm-12 col-xs-12\" data-original-title=\"\" title=\"\">\r\n                            <div class=\"benefit\" data-original-title=\"\" title=\"\">\r\n                                <h3 class=\"block-title\" data-original-title=\"\" title=\"\">\r\n                                    The Community\r\n                                </h3>\r\n                                <ul class=\"list\" data-original-title=\"\" title=\"\">\r\n                                    <li data-original-title=\"\" title=\"\"> Solves seemingly intractable problems through practical solutions.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Provides hope to a stricken community in the form of economic, social and\r\n                                        environmental transformation.\r\n                                    </li>\r\n                                    <li data-original-title=\"\" title=\"\"> Gives the community access to invaluable business acumen.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Enables the villagers to learn new skills and competences.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Long-term links with employees.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Transforms lives.</li>\r\n\r\n                                </ul>\r\n                            </div>\r\n                        </div>\r\n                    </div>', '', '', NULL, '2017-11-12 03:32:14', '2019-01-28 18:49:11');
INSERT INTO `stones` (`id`, `title`, `sub_title`, `image`, `link`, `url`, `editorDescription`, `participantDescription`, `meta_title`, `meta_description`, `deleted_at`, `created_at`, `updated_at`) VALUES
(24, 'University Students', 'Could your university students be part of a Race4Good team even more dynamic, passionate and creative than we have seen before?', NULL, '', '', '<p data-original-title=\"\" title=\"\">\r\n                            Could your university students be part of a Race4Good (R4G) team even more dynamic,\r\n                            passionate and creative than we have seen before? If yes, we would love to talk to you about\r\n                            how your university could get involved and the potential impact on students.\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            R4G takes passionate, inspiring and creative students and uses the skills they are\r\n                            developing through life and study and applies them to some of the worlds most intractable\r\n                            problems.\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            We can create a unique competition designed to stretch and challenge your students and\r\n                            provide them with an unforgettable, life-changing experience. With your help, we can form\r\n                            dynamic and passionate student teams and challenge them to develop business plans which will\r\n                            bring long-term economic and social uplift to a community in need. The winning plan will\r\n                            inject vibrancy, innovation and new market opportunities and restore hope and dignity to a\r\n                            community.&nbsp; The benefits and process are captured in a Race4Good PDF, link below.</p>\r\n                        <h2 data-original-title=\"\" title=\"\">\r\n                            Why R4G?\r\n                        </h2>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            For students, having a real and meaningful project, with real-life emotions, through which\r\n                            they can test and stretch their developing skills on a personal and professional level has\r\n                            proven to be highly effective and highly rewarding. Much more so than any hypothetical or\r\n                            traditional classroom-based course.\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            Knowing that each action taken by students has real impact on real people in a community\r\n                            enhances engagement, excites participants and provides the determination to find the best\r\n                            solution and bring about real change. Teams are given a specific timeframe in which to\r\n                            research and develop their plan and are given surprise challenges to tackle along the way.\r\n\r\n                        </p>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            Student teams are fully supported throughout the competition by local business leaders or\r\n                            alumni as well as the R4G operations team.\r\n                        </p>\r\n                        <h2 data-original-title=\"\" title=\"\">Award</h2>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            In a truly unforgettable experience, the winning team will be flown to meet the community\r\n                            and see the first phase of their plan brought to life.\r\n                        </p>\r\n                        <h2 data-original-title=\"\" title=\"\">Benefits to Universities</h2>\r\n                        <p data-original-title=\"\" title=\"\">\r\n                            R4G is designed to spark innovation in emerging leaders, enhance cross-cultural\r\n                            communication, test and stretch, improve confidence and produce skilled collaborators able to translate complex strategy into practical solutions. To progress successfully,\r\n                            participants are required to undertake research that is not easily available, to use sources\r\n                            other than the internet, to discover the skills of each team member, to consider anothers\r\n                            perspective and work closely together to achieve the best solution. For many participants,\r\n                            this will require them to stretch their emerging business knowledge whilst developing their skills and channelling their energy into a team they believe capable of changing the world.\r\n                        </p>\r\n                       \r\n                        <p data-original-title=\"\" title=\"\">\r\n                            If you would like to learn more and discuss the possibilities with Linda\r\n                                Cruse, <a href=\"http://therace4good.com/contact-us\" data-original-title=\"\" title=\"\">CONTACT US</a>.\r\n                        </p>', '<div class=\"section-title\" data-original-title=\"\" title=\"\">\r\n                        <h2 data-original-title=\"\" title=\"\">Benefits for participants</h2>\r\n                    </div>\r\n                    <div class=\"row\" data-original-title=\"\" title=\"\">\r\n                        <div class=\"col-md-4 col-sm-12 col-xs-12\" data-original-title=\"\" title=\"\">\r\n                            <div class=\"benefit\" data-original-title=\"\" title=\"\">\r\n                                <h3 class=\"block-title\" data-original-title=\"\" title=\"\">\r\n                                    Universities\r\n                                </h3>\r\n                                <ul class=\"list\" data-original-title=\"\" title=\"\">\r\n                                    <li data-original-title=\"\" title=\"\"> Increases productivity through the feel good factor.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Offers real-life problem solving to unleash creativity and innovation.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Provides the ultimate fast- track skills upgrade.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Enhances company image and reinforces brand loyalty.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Provides deeper understanding of global cultures.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Improves employee engagement and team building.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Provides strong links with a third world community.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Enables companies to leave a long-term and meaningful legacy.</li>\r\n                                    <li data-original-title=\"\" title=\"\">Provides CSR engagement and data.</li>\r\n                                </ul>\r\n                            </div>\r\n                        </div>\r\n                        <div class=\"col-md-4 col-sm-12 col-xs-12\" data-original-title=\"\" title=\"\">\r\n                            <div class=\"benefit\" data-original-title=\"\" title=\"\">\r\n                                <h3 class=\"block-title\" data-original-title=\"\" title=\"\">\r\n                                    Student\r\n                                </h3>\r\n                                <ul class=\"list\" data-original-title=\"\" title=\"\">\r\n                                    <li data-original-title=\"\" title=\"\"> Provides a unique challenge which improves morale.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Increases productivity.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Provides the ultimate skills upgrade.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Builds better team working.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Improves leadership and cross-cultural communication.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Boosts confidence in capabilities and strengthens CV.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Provides a deeper understanding of global cultures and forges long-term links\r\n                                        with a community.\r\n                                    </li>\r\n                                    <li data-original-title=\"\" title=\"\"> Provides a unique opportunity to join Linda Cruse on the frontline.</li>\r\n\r\n                                </ul>\r\n                            </div>\r\n                        </div>\r\n                        <div class=\"col-md-4 col-sm-12 col-xs-12\" data-original-title=\"\" title=\"\">\r\n                            <div class=\"benefit\" data-original-title=\"\" title=\"\">\r\n                                <h3 class=\"block-title\" data-original-title=\"\" title=\"\">\r\n                                    The Community\r\n                                </h3>\r\n                                <ul class=\"list\" data-original-title=\"\" title=\"\">\r\n                                    <li data-original-title=\"\" title=\"\"> Solves seemingly intractable problems through practical solutions.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Provides hope to a stricken community in the form of economic, social and\r\n                                        environmental transformation.\r\n                                    </li>\r\n                                    <li data-original-title=\"\" title=\"\"> Gives the community access to invaluable business acumen.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Enables the villagers to learn new skills and competences.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Long-term links with students.</li>\r\n                                    <li data-original-title=\"\" title=\"\"> Transforms lives.</li>\r\n\r\n                                </ul>\r\n                            </div>\r\n                        </div>\r\n                    </div>', '', '', NULL, '2017-11-12 03:32:14', '2019-10-28 23:17:49'),
(25, 'Volunteer', 'Do you want to make a difference - could you be our next star volunteer?', NULL, '', '', '<p data-original-title=\"\" title=\"\">Linda Cruse dedicates her life to uplifting communities around the world with a hand up, rather than a handout. To ensure every penny counts, Linda relies heavily on the goodwill of dedicated volunteers who support her work and who want to make a difference.</p>\r\n                <p data-original-title=\"\" title=\"\">Do you have any skills and experience you could share with Linda? Can you spare a couple hours a week occasionally? Or could you dedicate some time to work with us work on a project? If yes, we would love to hear from you.</p>\r\n                <br data-original-title=\"\" title=\"\">', '<h4 data-original-title=\"\" title=\"\">&nbsp; &nbsp;We would particularly welcome your help with:</h4>                                          \r\n   <ul data-original-title=\"\" title=\"\">\r\n            <li data-original-title=\"\" title=\"\">Fundraising/Awareness Raising</li>\r\n            <li data-original-title=\"\" title=\"\">Social Media</li>\r\n            <li data-original-title=\"\" title=\"\">Writing case studies and other compelling articles</li>\r\n            <li data-original-title=\"\" title=\"\">Research</li>\r\n            <li data-original-title=\"\" title=\"\">Networking</li>\r\n        </ul>', '', '', NULL, NULL, '2017-11-19 22:44:58'),
(26, 'What We Do', 'Race4Good brings together teams from business and universities in a dynamic virtual game to solve real-life obstacles facing challenged communities.', NULL, '', '', '<p class=\"MsoNormal\" data-original-title=\"\" title=\"\">The Race4Good invites the brightest and best brains from\r\nbusiness and universities and forms them into dynamic teams to harness their\r\nexperience, innovation and passion.&nbsp;\r\nParticipants dont just experience the Race4Good, they experience a personal\r\ntransformation.<o:p data-original-title=\"\" title=\"\"></o:p></p>\r\n                        <h2 data-original-title=\"\" title=\"\" style=\"color: rgb(0, 0, 0);\">What is R4G?</h2><p class=\"MsoNormal\" data-original-title=\"\" title=\"\"><o:p data-original-title=\"\" title=\"\"></o:p></p><p class=\"MsoNormal\" data-original-title=\"\" title=\"\">This unique leadership programme was developed by Linda\r\nCruse, drawing on her 18 years experience as an international leader at the\r\nfrontline. &nbsp;The Race4Good can be offered\r\nas a stand-alone competition, a fully tailored, deep-immersion leadership\r\nprogramme for business or a workshop. &nbsp;&nbsp;A unique way to attract, develop, motivate and\r\nretain employees.<o:p data-original-title=\"\" title=\"\"></o:p></p>\r\n                        <p class=\"MsoNormal\" data-original-title=\"\" title=\"\">Teams are usually given up to 21 days in which to research real-life\r\nobstacles facing a specific challenged community and to develop a business plan\r\nwhich will bring long-term economic uplift. &nbsp;The winning plan will inject vibrancy,\r\ninnovation and new market opportunities into the community; will restore hope\r\nand dignity to the villagers and transform lives.&nbsp; It\'s virtual gaming and leadership with a real-world twist!<o:p data-original-title=\"\" title=\"\"></o:p></p>\r\n                        <h2 data-original-title=\"\" title=\"\" style=\"color: rgb(0, 0, 0);\">Why R4G?</h2><p class=\"MsoNormal\" data-original-title=\"\" title=\"\">Central to the Race4Good leadership programme is a dynamic,\r\nvirtual race through which leadership skills are discovered, developed, challenged\r\nand embedded through high-impact, experiential learning and situational leadership challenges.&nbsp; Within\r\nthis healthy but pressurised environment, accelerated change takes place as participants\r\nbecome fully immersed within the community and race against other teams to develop the winning plan.&nbsp; &nbsp;Inspired by gamification for learning, the professional and personal rewards are immense and the storytelling\r\nopportunities unlimited.&nbsp; &nbsp; For more information about the benefits to business and to learn why gamification and learning are such a powerful combination&nbsp;<a href=\"http://www.therace4good.com/Get-Involved/Business-Leaders\" data-original-title=\"\" title=\"\">CLICK HERE</a>.<o:p data-original-title=\"\" title=\"\"></o:p></p><p class=\"MsoNormal\" data-original-title=\"\" title=\"\">The winning team are flown out to meet the community and see\r\ntheir plan brought to life.&nbsp;</p><p class=\"MsoNormal\" data-original-title=\"\" title=\"\">To learn more about Linda\'s work and programmes visit: <a href=\"http://www.lindacruse.com\" data-original-title=\"\" title=\"\">www.lindacruse.com</a></p><p class=\"MsoNormal\" data-original-title=\"\" title=\"\"><o:p data-original-title=\"\" title=\"\"></o:p></p>\r\n                        <p data-original-title=\"\" title=\"\">For a downloadable summary of the Race4Good <a href=\"http://therace4good.com/pdf/6a0035f592d437c320ac186ae1d60e1d.pdf\" target=\"_blank\" data-original-title=\"\" title=\"\" style=\"\">CLICK HERE</a>.<br data-original-title=\"\" title=\"\"></p>', NULL, 'What we Do', '', NULL, NULL, '2018-06-22 18:14:47'),
(27, 'Where We Work', 'You will find Race4Good wherever we can apply the entrepreneurial skills, innovation and passion of our dynamic teams of business leaders and students.', NULL, '', '', '<p data-original-title=\"\" title=\"\">We work on the frontline, primarily in villages affected by natural disasters, but also in remote and challenged communities, in refugee camps and in war-torn areas worldwide. We focus on working with forgotten people who reside the furthest from an airport, road or railway station.&nbsp; We also work in first world countries, wherever our clients need our help to tackle a challenge.&nbsp; Recent races have taken part in USA, Australia, British Virgin Islands and Nepal.</p>\r\n                            <p data-original-title=\"\" title=\"\">You will find us wherever we can apply the entrepreneurial skills, innovation and passion of our dynamic teams of business leaders and students.</p>\r\n                            <p data-original-title=\"\" title=\"\">Our involvement can range from mobilising business leaders to tackle the homeless situation in Los Angeles, to uplifting the youth in the British Virgin Islands or to bringing economic empowerment to a remote Himalayan village devastated by an earthquake.</p>\r\n                            <p data-original-title=\"\" title=\"\">Our combined Race4Good and Be The Change activities include:</p>\r\n                            <ul data-original-title=\"\" title=\"\">\r\n                                <li data-original-title=\"\" title=\"\">Philippines: the introduction of pig farming, fish farming and chicken breeding cooperatives following typhoon Haiyan.</li>\r\n                                <li data-original-title=\"\" title=\"\">Thailand: the creation of rubber harvesting in the aftermath of the 2004 tsunami.</li>\r\n                                <li data-original-title=\"\" title=\"\">Nepal: the establishment of innovative business ideas including candle-making, bee-keeping, bamboo growing and marigold cultivation in communities devastated by the 2015 earthquake.</li>\r\n                                <li data-original-title=\"\" title=\"\">Many of our projects have empowered individuals who have been able to employ others in a wide range of activities from tailoring, beauty treatments, goat and buffalo farming, secretarial services, mobile restaurants, hairdressing, laundries, motorbike taxi services, deep-sea fishing, tourist boat excursions, market gardening, geese breeding, coffee growing and catering.</li>\r\n                            </ul>\r\n                            <p data-original-title=\"\" title=\"\">For further details, see <a href=\"http://therace4good.com/success-stories\" data-original-title=\"\" title=\"\"> SUCCESS STORIES</a>.</p>', NULL, 'Where we Work', '', NULL, NULL, '2019-02-02 20:14:03');
